INSERT INTO `obras` VALUES (41, 'Ref. y Amp. IGLESIA " San Martín de Tours "', 'Resol. N° 6507/07', 387114.05, 11, 1, 3, 1, 120, 3, 36, 2, '2007-03-12 00:00:00', '2007-03-22 00:00:00', '2007-07-20 00:00:00', 'Levantada en julio del año 1899 e inaugurada por el entonces Presidente de la Nación Julio Argentino Roca. Se realizaron trabajos de ajustes en las carpinterías, instalaciones eléctrica, pilares, muros, portones de acceso, rampas p/ acceso vehicular, se restauro además el vitreaux en mal estado ubicado detrás del altar y se completo la vereda municipal con losetas. Como elemento de conector entre la iglesia y la ampliación del nuevo salón de usos múltiples se construyo un sendero, y en el SUM propiamente dicho se realizaron las tareas de refacción y ampliación generando un hall que jerarquiza el mismo.', '13 00 02 56', 11, 77294.66, 31, '2007-11-09 00:00:00', NULL, NULL, NULL, NULL, NULL, NULL, 'Resol. N° 896/07', NULL, NULL, 'Resol. N° 896/07', NULL, NULL, NULL, NULL, 36920.52, 22968.09, NULL, 'Expte. N° 140-1438/07', 'Expte. N° 140-3933/07', NULL, 1, 2007, NULL, 0, 'Jun-06', 0, NULL, 713, 387114.05, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, 0, NULL);
