INSERT INTO `obras` VALUES (51, 'Refacción Parcial Parroquia "Nuestra Señora de Fátima"', 'A.D. N° - Disp. N° 24/07', 53061.86, 8, 1, 3, 1, 60, 1, 4, 2, '2007-01-28 00:00:00', '2007-02-12 00:00:00', '2007-04-13 00:00:00', 'Los trabajos ejecutados en la Parroquia correspondieron básicamente al cambio del piso de la nave central, a tal efecto se previó la demolición del piso y contrapiso de la nave central.\r\nEstos trabajos se completaron con la colocación del mismo piso en los sectores del interior de la Parroquia y del patio lateral, previéndose además la demolición del contrapiso de la vereda municipal y su posterior ejecución a nuevo, concluyendo finalmente con la pintura en los muros interiores de la parroquia y la construcción de cámaras de desagües.', '13 00 05 57', 1, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 5448.51, NULL, NULL, 'Expte. N° 140-1903/07', NULL, NULL, 1, 2007, NULL, 0, NULL, 0, NULL, 256, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, 0, NULL);
