INSERT INTO `obras` VALUES (63, 'Salón de Usos Múltiples - Capilla "San Martín de Porres"', 'A.D. N° - Disp. N° 275/06', 198425.27, 12, 1, 3, 1, 90, 1, 4, 2, '2006-12-21 00:00:00', '2007-01-04 00:00:00', '2007-04-04 00:00:00', 'La obra presenta una edificación vetusta y obsoleta, por lo que se ejecuto un proyecto integral que complete todas las necesidades de la comunidad religiosa del sector. De acuerdo a las indicaciones emitidas por la superioridad, y dado el volumen importante de la misma se dividió en etapas. En la primera se ejecuto el Salón de Usos Múltiples, que fuera considerada de primera necesidad su realización, debido a que en el recinto se realizan diversas actividades como ser: Dictado de Catequesis, Apoyo Escolar, Cáritas, Reunión de Club de Abuelos y Cursos de Alfabetización.', '13 00 02 63', 1, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 2007, NULL, 0, NULL, 0, NULL, 138, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, 0, NULL);
