INSERT INTO `obras` VALUES (76, 'Comedor EGB 3 - Hogar Escuela "Juan Domingo Perón"', 'L.P. N° 06/06 - Resol. N° 565/06', 720170.86, 24, 6, 3, 1, 180, 2, 4, 3, '2006-06-28 00:00:00', '2006-07-20 00:00:00', '2007-01-16 00:00:00', 'En una segunda etapa el proyecto se planteo a partir de una necesidad imperiosa para la atención de los 300 alumnos que, por turno, concurren diariamente al establecimiento, y que reciben la denominada “copa de leche”. Era urgente contar con un espacio que permita desplegar esta actividad considerando que actualmente se lo hacía al aire libre. Con esto en mente es que se planteó la construcción de un Comedor de 220 m2 con cocina, despensa y sanitarios para personal. Contempla el proyecto, además, una galería perimetral y la reconstrucción del campo deportivo.', '13 00 01 65', 1, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, 12, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 144127.98, 14629.82, NULL, 'Expte. N° 140-2666/06', 'Expte. N° 140-0554/07', NULL, 1, 2007, NULL, 0, NULL, 0, NULL, 854, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, 0, NULL);
