INSERT INTO `obras` VALUES (102, 'Ref. y Amp. Escuela N°10 "Remedios E. de San Martín" 2 Etapa', 'Resol. N° 329/06', 774979.86, 11, 1, 3, 1, 180, 2, 4, 3, '2006-05-22 00:00:00', '2006-06-01 00:00:00', '2006-11-28 00:00:00', 'En una primera etapa se remodela el acceso al Salón de Actos y a los baños existentes. Se construye un núcleo sanitario que incluye Sanitario para Alumnos, Docentes y Discapacitados; además del Acceso de la E.G.B. 3, locales administrativos, Sala de Informática y el Centro de Recursos Pedagógicos, que compartirán los 3 niveles de enseñanza.   \r\nLa segunda etapa contempla la refacción del ala este del edificio existente que será destinado para Aulas, Taller de Tecnología y Laboratorio, dotándolo de Acceso para la E.G.B. 1-2 y galería cubierta. También se construye sobre calle Moreno 4 Aulas y los locales administrativos de la E.G.B. 1 y 2, con Sanitarios para Docentes y Office.', '13 00 04 86', 1, 0, 0, NULL, 0, 0, NULL, 0, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 45626.93, 50051.81, NULL, 'Expte. N° 140-2663/06', 'Expte. N° 140-3145/06', NULL, 1, 2006, NULL, 0, 'Oct-05', 0, NULL, 853, 774979.86, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, 0, NULL);
