INSERT INTO `obras` VALUES (104, 'Ref. Parcial Hogar Escuela - sector dormit, aulas, s.actos..', ' Resol. N° 362/04', 409185.48, 6, 8, 3, 1, 120, 2, 4, 3, '2004-11-15 00:00:00', '2004-11-25 00:00:00', '2005-03-25 00:00:00', 'En una primera etapa debido al paso del tiempo y el deterioro que ello ocasiona, se ejecutaron trabajos de refacción parcial de: los techos  del sector de los dormitorios, sector aulas, caldera, salón de actos  y sanitarios. Con tareas retiros y demoliciones  realizándose en la Mayoría de los sectores el reemplazo a nuevo de la cubierta. Revoques, cielorrasos, carpinterías, instalaciones sanitaria y eléctrica prácticamente a nuevo con provisión de equipos para el mejor funcionamiento del nombrado hogar.', '13 00 01 65', 1, 81837.09, 32, '2005-10-03 00:00:00', 90133.59, 32, '2005-12-16 00:00:00', 0, NULL, 0, 'Resol. N° 586/05', 'Dec. N° 2651/05', NULL, 'Resol. N° 586/05', 'Dec. N° 2651/05', '(*) Expte. N° 140-3037/05 $ 8760,66 y Expte. N° 140-1225/06 $ 28053,03', NULL, NULL, 9161.73, 5175.54, 36813.69, 'Expte. N° 140-0169/05', 'Expte. N° 140-2930/05', 'varios (*)', 1, 2005, NULL, 0, NULL, 0, NULL, 854, 409185.48, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, 0, NULL);
