INSERT INTO `obras` VALUES (187, 'Restauración y Conserv. Iglesia "Ntra Sra. de la Merced"', 'L.P. N° 13/07 - Resol. N° 475/08', 1749230.09, 11, 1, 3, 1, 240, 2, 4, 2, '2008-04-28 00:00:00', '2008-05-19 00:00:00', '2009-01-14 00:00:00', NULL, '13 00 05 95', 1, 301552.23, 61, '2009-03-16 00:00:00', 44429.1, 60, '2009-05-15 00:00:00', 17, '2009-06-01 00:00:00', 13, 'Resol. N° 1540/08', 'Resol. N° 187/09', 'Resol. N° 457/09', 'Resol. N° 1540/08', 'Resol. N° 457/09', 'Expte. N° 140-0035/09 y Expte. N° 140-1924/10 y Expte. N° 140-1923/10 y Expte. N° 140-2089/10 y Expte. N° 140-3723/11 y Expte. N° 140-3722/11 y  Expte. N° 140-3724/11  de $61187,09 y $3299,67 y $ 10678,79 y $18689,27 y $ 3519,54 y $ 744,59 y $291,61', 0, NULL, 269276.57, 77106.68, 98410.56, 'Expte. N° 140-3346/08', 'Expte. N° 140-6337/08', 'Expte. N° 140-0035/09', 1, 2010, NULL, 0, NULL, 0, NULL, 630, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 1, '2010-06-10 00:00:00', 0, NULL);
INSERT INTO `obras` VALUES (188, 'Basket Ball Club Hercules - Refaccion y Ampliacion', 'A.D. N° 10/11 - Disp. N° 83/11', 480942.84, 103, 37, 3, 1, 120, 1, 4, 12, '2011-03-23 00:00:00', '2011-04-06 00:00:00', '2011-08-04 00:00:00', 'En el marco del Plan del Gobierno de la Provincia de Corrientes para la Recuperación y puesta a punto de Clubes y Sedes Deportivas y Sociales en toda la Provincia, la DPO desarrolló una intervención que contempló cuatro clubes de la ciudad de corrientes, el Club Atlético “Alvear”, el club “Pinguinos”, el Club “Hèrcules, y el Club Atlètico “el Tala”.\r\nEn todos, las prioridades fueron el cerramiento de la cancha principal y la posterior colocación de un nuevo piso deportivo de parquet.\r\nCon este objetivo, se construyeron tinglados cubiertos, y se realizaron cerramientos laterales con sus respectivos desagues. Además se construyeron y refaccionaron sanitarios y depósitos; además de la puesta a punto de las instalaciones sanitarias y eléctricas.\r\nTambién, en todos los casos, se construyó a nuevo una tribuna de hormigón armado con capacidades de entre 300 y 500 personas, las que se proyectaron y construyeron de acuerdo con las últimas normativas de seguridad, contemplando barandas y otros equipamientos necesarios para su completa funcionalidad. En todos los casos, se mejoraron los accesos principales, contemplando le reforma de los mismos con el objetivo de dotarlos de una imagen mejorada que le otorgue carácter e identidad. Una intervención completa a los edifi cios y predios de las instituciones a fi n de brindarles edifi caciones, servicios y equipamientos\r\nóptimos para el desarrollo de sus actividades.', '13 00 02 63', 1, 0, 60, '2011-10-03 00:00:00', 0, 0, NULL, 0, NULL, 13, 'Resol. N° 1241/11', NULL, NULL, NULL, NULL, NULL, 0, NULL, 19151.97, 17591.09, NULL, 'Expte. N° 140-2646/11', 'Expte. N° 140-5457/11', NULL, 1, 2011, '140-000699/11', 1, 'Dic-10', 0, 10, 1061, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 1, '2011-12-15 00:00:00', 0, NULL);
