INSERT INTO `obras` VALUES (262, 'Iglesia "Santisima Cruz de los Milagros" - Restauracion y Conservacion', 'LP N° 7/ 11 - Resol. N° 300/11 - Resol. N° 535/11', 1798817.39, 24, 1, 3, 1, 180, 2, 4, 2, '2011-05-24 00:00:00', '2011-06-15 00:00:00', '2011-12-12 00:00:00', 'En una primera etapa se realiza la consolidación del Templo y oficinas anexas a fi n de restituirles las condiciones integrales (físico – químicas – mecánicas) de estabilidad, firmeza y solidez.', '13 00 02 58', 1, 148544.05, 60, '2012-02-10 00:00:00', 0, 30, '2012-04-09 00:00:00', 0, NULL, 14, 'Resol. N° 14/12', 'Resol. N° 165/12', NULL, 'Resol. N° 165/12', NULL, '* Expte 140-000635/12 $63,272,78 y Expte 140-1615/12 $38330,38 y  Expte 140-1618/12 $768,99', 0, NULL, 170818.51, 83178.48, 102372.15, '140-002950/11', '140-004812/11', '140-000635/12', 1, 2011, '000-000488/10', 1, 'Oct-10', 0, 10, 28, 1852541.08, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 1, '2012-05-21 00:00:00', 0, NULL);
INSERT INTO `obras` VALUES (263, 'Hospital Santa Rosa - Refaccion y Ampliacion', 'L.P N° 10/12 - Resol N° 641/12 - Resol N° 979/12', 3755788.57, 24, 26, 3, 1, 360, 2, 32, 6, '2012-09-07 00:00:00', '2012-10-01 00:00:00', '2013-09-26 00:00:00', 'El trabajo consto de la ampliación en un bloque nuevo que incluye Sector de Internación con 4 habitaciones de tres camas, Sector Partos, Enfermería y Servicios Generales, (Cocina - Comedor, Lavadero, Depósito General, Depósito Transitorio para Cadáveres, y Sala de Maquinas),  más una ampliación de un bloque de Emergencias con Shockroom, Enfermería, Consultorio Médico y Sala de Curaciones y Espera Pública.\r\nSe llevaro a cabo refacciones en el sector existente para reorganizar el Sector de Espera sobre los Consultorios Externos generando también las atenciones al público desde la administración y la farmacia con acceso directo desde el Hall Central, sector de Internaciones, y bloque posterior destinado a los residentes, entre otros.\r\nSe remodelo el Acceso Principal con su respectivo ingreso desde la calle, desde la que se accede también al sector de Emergencias. Se realizo un acceso secundario para el sector de Servicios con un playón de maniobras para carga - descarga y estacionamientos para los trabajadores del hospital.\r\nSe construyó nexos cubiertos entre el edificio existente y el bloque nuevo dotándole además de un tratamiento coherente a todo el conjunto hospitalario.\r\nSe reorganizó y refaccionó todas las instalaciones como ser las eléctricas, de agua, infraestructuras, provisión de sector de gases medicinales nuevos, mas las cubiertas existentes.', '13 00 07 78', 16, 505210.16, 70, '2013-12-05 00:00:00', 245947.55, 70, '2014-02-13 00:00:00', 205, '2015-12-18 00:00:00', 28, 'Resol. N° 884/13', 'Resol. N° 525/13', 'Decreto N° 1017', 'Resol. N° 884/13', 'Resol. N° 154/15', 'UTE Ing. FRANCISCO M. CRUZ - JOSE ANTONIO GOMEZ ENRIQUEZ\r\nRedet 1 elev 2/10/12\r\nAdic va por partida 96-0-1-53\r\n(*) Redet. Expte 140-2058/14