INSERT INTO `obras` VALUES (271, 'Iglesia San Francisco - Refaccion y Restauracion', 'LP N° 4/13 - Resol. N° 1150/13 - Resol. N° 1321/13', 6005100.22, 8, 30, 3, 1, 365, 2, 4, 2, '2013-09-18 00:00:00', '2013-10-01 00:00:00', '2014-09-30 00:00:00', 'El templo, se sitúa en la ciudad de Corrientes, sobre calle Mendoza al 400, entre Plácido Martínez y Quintana. Es una iglesia cuyo inicio de obra data del año 1860, y sus últimas etapas de obra hacia la 2º década del siglo XX, el cual pertenecía al Convento de la Orden Franciscana. El paso del tiempo ha provocado deterioros de distinto grado en la estructura física, lo que provocó diferentes anomalías y patologías en el interior y exterior del templo, las cuales son el motivo de la obra que se llevará a cabo y que tiene como fin la Puesta en valor del Histórico Templo. \r\nLa Dirección de Planificación y Obras, en base a un estudio de la consultora Ing. Bernal y Asociados, llevó adelante, con la empresa PROAS S.A., trabajos preliminares en el Patio Norte, con el objeto de sanear la zona perimetral aledaña al templo, que afectaba la estabilidad del edificio. Posteriormente, dicha consultora efectuó recomendaciones con respecto al modo de devolverle estabilidad a la pared de la nave lateral Norte del templo, que presentaba un volcamiento hacia el patio antes mencionado. \r\nLos trabajos de refacción y restauración se efectuaran en el templo propiamente dicho, en el museo sacro, la oficina parroquial y la biblioteca, tomando la refacción general dividida en sectores encarándose primeramente la consolidación y estabilidad de la pared Norte del templo, principalmente en el sector de contrasacristia.\r\nLas superficies a tener en cuenta, con las cuales se trabajara serán las siguientes:\r\nSuperficie terreno. 12.091 m2\r\nSuperficie cubierta existente. Templo, convento + anexos. 4.221,26 m2\r\nSuperficie existente a refaccionar y restaurar. 1.630,26 m2\r\nSuperficie a ampliar. 19,15 m2.', '96 00 02 58', 1, 1196798.09, 30, '2014-10-30 00:00:00', 0, 52, '2014-12-21 00:00:00', 38, '2015-05-08 00:00:00', 14, 'Resol. N° 184/14', 'Resol. N° 1167/14', 'Nota N° 223/15', 'Resol. N° 32/15', NULL, 'incluye exptes 000-4285/11 y 140-3916/06 y 140-04401/06 - Declarado MHN 1951\r\n(*) varios Expte N° 3487/14 de $ 248,707,32  y Expte N° 0146/15 de $ 600,810,01 y Expte N° 010/15 de 132,603,48 y Expte N° 139/15 de 5937,26\r\nResol. N° 32/15 de 100 dias 31/3/15', 0, NULL, 286479.53, 182455.22, 988058.07, 'Expte N° 4548/13', 'Expte N° 0795/14', '(*) Varios', 1, 2014, '140-001723/05', 1, 'jun-13', 0, 13, 884, 6081153.7, 0, '2013-08-20 00:00:00', 'DEyP', '2013-08-13 00:00:00', '2012-07-25 00:00:00', NULL, NULL, NULL, NULL, 0, 1, NULL, 0, NULL);
