INSERT INTO `obras` VALUES (292, 'Terminal de Omnibus - Refaccion', 'L.P. N° 1/14 - Resol. N° 385/14 - Resol. N° 715/14', 2751454.04, 127, 25, 3, 1, 180, 2, 4, 7, '2014-08-15 00:00:00', '2014-09-01 00:00:00', '2015-02-27 00:00:00', 'La obra consiste en refaccionar y poner en condiciones generales el edificio de la Terminal de Omnibus de la Ciudad de Corrientes.\r\nLos trabajos a ejecutar, comprenden la pintura de todos los paramentos exteriores en Planta Baja e interiores en Planta alta (Sector Administración) del edificio, exceptuando los interiores de boleterías y locales comerciales, como así también a la provisión y colocación de los cerámicos faltantes en el sector de boleterías y de los bancos que dan a los andenes del tren. También se procederá al rasqueteo de todos los paramentos, cielorrasos, carpinterías de madera y chapa, escaleras marinera y de tramo recto metálicas, vigas reticuladas, cordón y zócalo, para terminar con la pintura correspondiente. Además, se procederá a la demolición del pavimento de un sector del acceso principal de los ómnibus y al retiro y provisión del cerco, postes olímpicos, reparación y colocación del portón de acceso, como así también de placas de policarbonato y cenefas, en el sector sureste de las dársenas.\r\nEn el sector de mantenimiento se procederá a la construcción de una nueva cubierta, reemplazando la actual que se encuentra en malas condiciones.\r\nTambién se realizarán la puesta a punto del funcionamiento del tanque de reserva de agua, reparando las compuertas; y procediendo a la limpieza e impermeabilización interior; colocación de un nuevo sistema de corte; cambio del cableado del sistema, dos electro – bombas, cambio de llaves del tablero correspondiente, puesta a tierra y colocación del baliza reglamentaria. También en la escalera de acceso al tanque se colocará una jaula de protección como elemento de seguridad. \r\nSe completa la intervención, con el recambio de cartelería en Dársenas y señaleticas en sanitarios; y la construcción de una casilla para base de Remises, construída en paneles de aluminio.', '13 00 01 99', 1, 0, 45, '2015-05-13 00:00:00', 0, 100, '2015-07-22 00:00:00', 0, NULL, 44, 'Resol. N° 119/15', 'Resol. N° 309/15', NULL, NULL, NULL, NULL, 0, NULL, 0, 0, 0, NULL, NULL, NULL, 1, 2015, '140-003585/10', 1, 'Mar-14', 0, 10, 53, 2808794.64, 0, '2014-07-03 00:00:00', 'DEyP', NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, 0, NULL);
