INSERT INTO `obras` VALUES (304, 'Hospital "Dr M. Sussini" - Demolicion y construccion Emergencias', 'n', 4049751.32, 132, 24, 3, 14, 360, 2, 35, 6, '2008-01-01 00:00:00', '2008-01-01 00:00:00', '2008-01-01 00:00:00', 'El antiguo centro sanitario presentabna serias defi ciencias, tanto funcionales como constructivas, que impedían su reutilización con una mera refacción. Es así que se decide construir un nuevo edifi cio para el Hospital “Dr. Miguel Sussini”.\r\nCon casi 2500 metros cuadrados, este nosocomio presenta el nuevo edifi cio cuenta con las áreas Administrativa, Consultorios Externos, de Diagnostico ( Rayos X- Laboratorio- Hemotéca- ecografía), de Internación, de Centro Obstétrico (con modalidad de parto Humanizado), Sector de Emergencias, Servicios Generales Esterilizaciones, Sector de Instalaciones especiales, Depósitos de cadáveres, Depósitos de Residuos Patológicos y Sectores de estacionamientos.\r\nFueron demolidos 1600 metros cuadrados de un total de 2000, y se\r\nrefaccionaron 400 metros cuadrados.\r\nla superfi cie nueva construída es de 2000 metros cuadrados aproximadamente, guardando un área de resreva en el terreno implantado, de alrededor de 7000 metros cuadrados.', '13 00 03 75', 9, 0, 0, NULL, 0, 0, NULL, 0, NULL, 17, NULL, NULL, NULL, NULL, NULL, 'con Expte: 310-5105/13', 0, NULL, 0, 0, 0, NULL, NULL, NULL, 0, 2012, '310-010349/10', 0, 'sep-12', 0, 13, 832, 4049751.32, 0, NULL, 'DEyP', NULL, '2013-06-25 00:00:00', NULL, NULL, NULL, NULL, 0, 0, NULL, 0, NULL);
