INSERT INTO `obras` VALUES (341, 'Club Alvear - Refaccion y Ampliacion 1a etapa', 'A.D. N° 17/11 - Disp. N° 125/11', 498766.7, 31, 6, 3, 1, 120, 1, 4, 12, '2011-04-11 00:00:00', '2011-05-02 00:00:00', '2011-08-30 00:00:00', 'En el marco del Plan del Gobierno de la Provincia de Corrientes para la Recuperación y puesta a punto de Clubes y Sedes Deportivas y Sociales en toda la Provincia, la DPO desarrolló una intervención que contempló cuatro clubes de la ciudad de corrientes, el Club Atlético “Alvear”, el club “Pinguinos”, el Club “Hèrcules, y el Club Atlètico “el Tala”.\r\nEn todos, las prioridades fueron el cerramiento de la cancha principal y la posterior colocación de un nuevo piso deportivo de parquet.\r\nCon este objetivo, se construyeron tinglados cubiertos, y se realizaron cerramientos laterales con sus respectivos desagues. Además se construyeron y refaccionaron sanitarios y depósitos; además de la puesta a punto de las instalaciones sanitarias y eléctricas.\r\nTambién, en todos los casos, se construyó a nuevo una tribuna de hormigón armado con capacidades de entre 300 y 500 personas, las que se proyectaron y construyeron de acuerdo con las últimas normativas de seguridad, contemplando barandas y otros equipamientos necesarios para su completa funcionalidad. En todos los casos, se mejoraron los accesos principales, contemplando le reforma de los mismos con el objetivo de dotarlos de una imagen mejorada que le otorgue carácter e identidad. Una intervención completa a los edifi cios y predios de las instituciones a fi n de brindarles edifi caciones, servicios y equipamientos\r\nóptimos para el desarrollo de sus actividades.', '13 00 09 68', 1, 0, 60, '2011-10-29 00:00:00', 0, 0, NULL, 0, NULL, 13, 'Resol. N° 1263/11', NULL, NULL, NULL, NULL, NULL, 0, NULL, 52272.29, 23982.76, 0, 'Expte. N° 140-2224/11', 'Expte. N° 140-0188/12', NULL, 1, 2011, '140-000894/11', 1, 'Jun-10', 0, 10, 1009, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 1, '2012-02-22 00:00:00', 0, NULL);
