INSERT INTO `obras` VALUES (408, 'Escuela N° 450 "Oscar Alderete" - Refaccion y Ampliacion', 'L.P. N° 6/11 - Resol. N° 473/11 - Disp 48/13(Econ)', 1730859.32, 25, 8, 3, 1, 300, 2, 87, 3, '2011-05-31 00:00:00', '2011-07-14 00:00:00', '2012-05-09 00:00:00', 'La ampliación del edifi cio existente consiste en la provisión de una\r\ncancha de básquet, un área de obra nueva: dependencias de dirección, administración, sanitarios de docentes, cocina, aulas y SUM de la escuela primaria ; sanitarios de alumnos, sanitarios de docentes, aula y SUM del jardín de infantes.-\r\nLa refacción refuncionalizó el edifi cio existente en siete aulas comunes todas con sus armarios y una de ellas con la instalación apropiada para la instalación de ordenadores personales.\r\nEntre los bloques ampliados de la escuela primaria y del Jardín de\r\nInfantes se construyó un playón de la cancha de básquet, complementario de la cancha de futbol. Fueron provistas con sistemas de iluminación, que se utilizarán complementariamente para las actividades de los usuarios regulares así como a los usuarios eventuales de la comunidad.-', '13 00 08 98', 21, NULL, 30, '2012-06-11 00:00:00', NULL, 30, '2012-07-10 00:00:00', NULL, NULL, 32, 'Resol. N° 1555/11', 'Nota N° 451/12', 'Resol. N° 1536/13', NULL, NULL, 'La Disp. N° 48/13 aprueba el balance de Economía y Demasía para cerra la obra - Conv Normaliz. Aprueba amplaicion de plazos hasta el 31/7/13\r\n(*) Varios Expte N° 140-732/12 de $168883,70 y Expte N° 140-733/12 de $108857,56 y Expte N° 140-734/12 de $34904,64 y Expte N° 140-063/12 de $15285,36 y Expte N° 140-061/14 de $3918,67 y Expte N° 140-062/14 de $15842,28', NULL, NULL, 193007.84, 14263.23, 347692.21, 'Expte. N° 140-3136/11', 'Expte. N° 140-0060/14', '(*)', 1, 2011, '140-000404/10', 1, 'Abr-10', 0, 13, 5, 1769830.31, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, NULL, 0, NULL);
