INSERT INTO `obras` VALUES (421, 'Iglesia "Santisima Cruz de los Milagros" - Rest. y Conserv - 2da Etapa', 'L.P. N° 2/12 - Resol. N° 161/12 -Resol. N° 296/12', 1378297.03, 24, 9, 3, 1, 180, 2, 4, 2, '2012-03-30 00:00:00', '2012-04-18 00:00:00', '2012-10-15 00:00:00', 'Como segunda etapa, se procede a la restauración edilicia con el fi n de reparar o enmendar los daños provocados por las patologías identifi cadas en el relevamiento y análisis del edifi cio. Una última instancia contempla la conservación del templo y anexos a fi n de proteger el edifi cio de posibles daños y\r\ndeterioros futuros, para lo cual se realizó extracción de vegetación y limpieza de muros, movimiento de suelos, construcción de muros de carga para cubierta nueva en dependencias anexas, cuatro dados de mampostería en la torre del campanario para apoyo de estructura del carillón.; repaso de cubierta existente, refuerzo estructura de madera en la nave central, construcción de canaletas y gárgolas; reconstrucción del cielorraso aplicado de la nave central, restauración de azoteas, de membranas, aislaciones ; realización de revoques interior con demolición del revoque existente. Y revoque exterior completo; restauración, reparación y reconstitución de cornisas, molduras y capiteles interiores y exteriores. Se repasan los entrepisos, reparan y repasan pisos, contrapiso, carpintería, instalación eléctrica de audio y pararrayos como así también reparación de instalaciones pluviales originales.', '13 00 02 58', 1, 251740.25, 55, '2013-04-24 00:00:00', NULL, NULL, NULL, NULL, NULL, 14, 'Resol. N° 250/13', NULL, NULL, 'Resol. N° 250/13', NULL, 'Etapa Frente, Accesos, Interior Templo, Nucleos sanitarios 1 redet elev 21/5/12', NULL, NULL, 119640.47, 83293.43, 57165.11, 'Expte. N° 140-1553/12', 'Expte. N° 140-4237/12', 'Expte. N° 140-1195/13', 1, 2012, '140-000268/12', 0, 'Oct-11', 0, 10, 28, 1393908.81, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 1, '2012-05-21 00:00:00', 0, NULL);
