INSERT INTO `obras` VALUES (430, 'Refacción y Ampliacion Esc. N° 16 "Pedro Ferré" y JIN N° 8', 'Disp. N° 36/10 - Expte N° 140-002757/09', 329914.73, 73, 23, 3, 1, 90, 1, 2, 3, '2010-03-04 00:00:00', '2010-03-08 00:00:00', '2010-06-06 00:00:00', 'La intervención se realizó a la Escuela N° 16 y el Jardín N° 8\r\nSe ejecutaron trabajos de refuncionalización de los espacios, trabajos de reparación y sustitución de la infraestructura y patologías constructivas (técnicos) en estado de precariedad, se procedió a la Revalorización de la Fachada principal, dotándola de iluminación de realce escénico y reparando integralmente las carpinterías.\r\nSe Puso en Valor y se repararon carpinterías de las aulas, se proveyó e instaló un Corrector automático de factor de Potencia solicitado por la DPEC para ajustarse a la normativas vigentes de grandes consumidores, se Refaccionaron revoques y se ejecutó Pintura Integral de todos los Salones.\r\nSe construyó un depósito de mercaderías, contiguo a la torre del\r\ntanque de agua, y se amplió el aula 30 reconstruyendo una pared\r\naproximadamente a 2 m de la demolida dándole una mayor dimensión al espacio. También se proveyeron e instalaron dos electrobombas nuevas ejecutando a nuevo cañerías de bajadas y bebederos en el sector deportes.se refaccionaron integrarlmente las Veredas y se instalaron Rejas Divisorias entre el Jardín y la Escuela.', '13 00 08 70', 21, NULL, 18, '2010-06-24 00:00:00', NULL, 45, '2010-08-08 00:00:00', 63, '2010-10-10 00:00:00', 21, 'Resol. N° 140-001076/10', 'Resol. N° 140-000714/10', 'Resol. N° 140-000874/10', NULL, NULL, NULL, NULL, NULL, 25931.29, 19438.68, 0, 'Expte. N° 140-001076/10', 'Expte. N° 140-004658/10', NULL, 1, 2010, '140-002757/09', 1, 'Dic-08', 0, NULL, 598, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, 0, NULL);
