INSERT INTO `obras` VALUES (451, 'Intervención Integral - Penal N° 1 - Pab. Min. Seguridad', 'L. Priv. N° 01/09 - Resol. N° 699/09', 1885373.94, 8, 30, 3, 1, 240, 2, 4, 1, '2009-09-25 00:00:00', '2009-10-05 00:00:00', '2010-06-02 00:00:00', 'ASPECTOS CONSTRUCTIVOS\r\n1.	ESTRUCTURA RESISTENTE: el sistema constructivo estará compuesto por bases y columnas de hormigón armado de sección variables según cálculo. Los muros interiores y exteriores apoyarán sobre vigas de encadenados y pilotines de hormigón armado.\r\n2.	MAMPOSTERÍAS: se realizarán con ladrillos comunes y espesores variables según los requerimientos funcionales. Los revoques exteriores e interiores serán completos a la cal y con las aislaciones hidráulicas correspondientes en los lugares que así lo requieran, en los sectores de alojamiento el revoque hasta los 3m de altura será reforzado con malla.\r\n3.	CUBIERTA: se retirará estructura de madera existente y su cubierta y se reemplezará por chapa Hº Gº sinusoidal N° 25 fijada a correas metálicas sobre una estructura de cercha metálica, aislación bajo chapa Tipo TBA5 sobre malla metal desplagado pesado 500-30-29.\r\n4.	CARPINTERÍA: las puertas y ventanas serán de chapa doble Nº 16, en los accesos a los alojamientos se utilizarán rejas de hierros lisos macizos con estructura de hierros ángulos y planchuelas. Las ventanas del pabellón llevarán policarbonato de 6mm de espesor y en el sector de la guardia serán triples transparentes de 5mm. Se distribuirán rejas de hierros lisos macizos con ángulos, planchuelas y mallas de metal desplegado pesado, según correspondiera el caso. Los box de los sanitarios llevarán puertas de aluminio.\r\n5.	PISOS: de mosaico granítico 0,30 x 0,30m en el pabellón, en sanitarios de 0,15 x 0,15m y en el pasillo técnico y vereda perimetral exterior será de cemento rodillado, aplicado sobre contrapiso de hormigón de cascotes de 12cm de espesor, con malla de 15 x 15cm en las áreas de alojamiento.\r\n6.	CIELORRASOS: suspendido de chapa HºGº trapesoideal T - 101 fijada a correas metálicas, sujeta a la cercha metálica, aislación lana de vidrio con papel kraff, en el sector de sanitarios y alojamiento. En la guardia será aplicado bajo losa a la cal e independiente a la cal sobre metal desplegado, ambos terminación al fieltro.\r\n7.	PINTURAS: sobre los revoques exteriores se utilizará látex exterior, revoque interior látex para interiores, en el cielorraso de la guardia se pondrá látex para cielorrasos. En los sanitarios se dará una terminación con EPOXI hasta una altura de 2,10m. En las carpinterías y rejas esmalte sintético.\r\n8.	INSTALACIÓN ELÉCTRICA Y SANITARIA: serán embutidas con materiales adecuados para cada fin.', '13 00 01 91', 1, 0, 60, '2010-08-01 00:00:00', 0, 0, NULL, 0, NULL, 25, 'Resol N° 95/10', NULL, NULL, NULL, NULL, NULL, 0, NULL, 44896.11, 15182.04, 0, 'Expte. N° 140-000742/10', 'Expte. N° 140-002585/10', NULL, 1, 2010, NULL, 0, NULL, 0, NULL, 47, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, 0, NULL);
