INSERT INTO `obras` VALUES (476, 'Penal N° 1 - Pabellon Min. Seg. - Cuartos visita Intima', 'Disp. N° 138/10', 247305.02, 8, 8, 3, 1, 90, 1, 4, 1, '2010-09-07 00:00:00', '2010-09-22 00:00:00', '2010-12-21 00:00:00', 'El pabellón consta de dos sectores de alojamiento donde se dispondrán cuchetas para los internos; en base a la superficie de cada uno de los locales en cuestión y tenido en cuenta las Condiciones Básicas de Habitabilidad de los Establecimientos Dependientes del Servicio Penitenciario Federal.\r\nAsimismo estos alojamientos serán subdivididos en tres sectores cada uno, separados por cerramientos de rejas terminadas con esmalte sintético sobre metal.\r\nSe proveerán cuchetas metálicas a ejecutarse según detalle de armado de cama, para utilizar un colchón estándar de 0,80 x 1,90m.', '13 00 00 00', 1, 0, 0, NULL, 0, 0, NULL, 0, NULL, 25, NULL, NULL, NULL, NULL, NULL, 'paga Mrio Gobierno 1,0,0,1-331', 0, NULL, 25372.31, 0, 0, 'Expte. N° 140-003438/10', NULL, NULL, 1, 2010, '140-003547/09', 1, 'Feb-10', 0, NULL, 47, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, 0, NULL);
