INSERT INTO `obras` VALUES (478, 'Refaccion y Ampliacion Esc N° 891 "Pje Raices Norte"', 'C.P. N° 1/11 - Resol. N° 268/11', 503402.35, 75, 8, 3, 1, 120, 3, 2, 3, '2011-03-23 00:00:00', '2011-04-01 00:00:00', '2011-07-30 00:00:00', 'Se trata de una escuela rural compuesta por tres tipos de construcciones; un primer bloque donde se encuentra la escuela propiamente dicha perteneciente al programa de radicación de escuelas rancho; un segundo bloque donde funciona un aula aislada del resto sin galerías; y un tercer bloque previsto para comedor en un principio, pero sin uso actualmente. El proyecto contempla la refacción de lo existente y una ampliación consistente en la construcción de un nuevo bloque con 3\r\naulas comunes y sanitarios para uso exclusivo del nivel secundario.\r\nLos trabajos de refacción incluyeron, el tendido de una nueva instalacion eléctrica, la demolición y construcción a nuevo de los revoques, se completó parte del cielorraso y se ajustaron aberturas, colocando masillas, sustituyendo paños de vidrios faltantes o rotos, pintura, provisión de rejas y antepechos. También se proveyó de zócalo interior de madera en las dos aulas y en el exterior, se prolongaron la galería y el patio de formación hasta alcanzar las aulas nuevas. En el resto del perímetro de las aulas se construyó una vereda perimetral.\r\nSe reemplazó la acometida eléctrica desde el tendido público hasta\r\nel tablero principal por una conexión subterránea, y se proveyó de un pozo absorbente nuevo. Se concluyó con pintura general del edificio como exteriormente con las correspondientes pinturas. Además se construyó una canaleta a cielo abierto en todo el perímetro de uno de los bloques desaguando en un pozo absorbente.', '13 00 08 72', 21, 0, 0, NULL, 0, 0, NULL, 0, NULL, 31, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 33932.01, 59946.55, 0, 'Expte. N° 140-003993/11', 'Expte. N° 140-003072/11', NULL, 1, 2011, '140-001789/10', 1, 'Abr-10', 0, 13, 491, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, 0, NULL);
INSERT INTO `obras` VALUES (479, 'Ministerio de Gobierno Refac. Parcial Cubierta Sec.Posterior', 'A.D. N° 27/10 - Disp. N° 214/10', 385842.94, 79, 5, 3, 1, 120, 1, 4, 9, '2010-11-09 00:00:00', '2011-02-15 00:00:00', '2011-06-15 00:00:00', NULL, '01 00 00 33', 1, 0, 0, NULL, 0, 0, NULL, 0, NULL, 14, NULL, NULL, NULL, NULL, NULL, '1.0.0.1.331', 0, NULL, 41671.87, 31501.55, 0, 'Expte. N° 140-0088/12', 'Expte. N° 140-0089/12', NULL, 1, 2011, '205-000050/10', 1, 'Abr-10', 0, NULL, 460, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, 0, NULL);
INSERT INTO `obras` VALUES (480, 'Refaccion Escuela N° 922 - Pje Isla Alta', 'Adj. Directa N° 10/10 - Disp. N° 124/10', 398242.88, 76, 31, 3, 1, 120, 1, 2, 3, '2010-07-29 00:00:00', '2010-08-11 00:00:00', '2010-12-09 00:00:00', 'La escuela está ubicada en el citado Paraje, en zona rural, accediendo a través de un camino de tierra arenoso. Actualmente se conforma de 2 edifi caciones: una antigua y otra más nueva, de características constructivas que datan de diferentes años.\r\nLa construcción más antigua es una construcción precaria y está en estado deplorable, no susceptible de ser rescatada. En esta intervención, previó una demolición parcial de dicho sector, contemplando las aulas sin cubierta y el núcleo sanitario por ser un peligro eminente para todas las personas que allí concurren.\r\nSe construyó un nuevo bloque de iguales características constructivas al existente, conteniendo un aula común, una sala jardín con su correspondiente sanitario, un consultorio, cocina y comedor. La sala jardín contempla un patio delimitado para uso exclusivo de los niños que allí concurren. De esta manera se cubren las necesidades físicas más urgentes a resolver. Este bloque se construyó enfrentado al existente cercando el patio de formación para generar un SUM cerrado de uso común a todo el establecimiento en una etapa posterior.\r\nTambién se realizaron trabajos en las instalaciones Eléctrica y Sanitaria existentes a fi n de dejarlas en condiciones optimas de funcionamiento.', '13 00 08 74', 21, 0, 0, NULL, 0, 0, NULL, 0, NULL, 31, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 44306.78, 8295.53, 4921.8, 'Expte. N° 140-002887/10', 'Expte. N° 140-004899/11', 'Expte. N° 140-006071/11', 1, 2010, '140-001497/10', 1, 'Dic-09', 0, NULL, 450, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, 0, NULL);
