INSERT INTO `obras` VALUES (491, 'Hospital "J.R. Vidal" Servicio de Maternidad - Refacc y Amp.', 'L.P. N° 2/11 - Resol. N° 304/11', 2935452.31, 14, 27, 3, 1, 270, 2, 4, 6, '2011-04-08 00:00:00', '2011-04-25 00:00:00', '2012-01-20 00:00:00', 'Esta intervención, planteó la refuncionalización interviniendo:\r\n1-La construcción de un bloque de Consultorios Externos y atención al Público. Desarrollando 10 consultorios externos, sala de espera para 30 personas, vacunatorio, unidad de enfermería, y sectores de investigaciones e informes; sala de reunión para médicos y accesos diferenciados.\r\n2-La construcción de una Casa para Madres, con capacidad para 12 camas, distribuidas en 3 habitaciones con baño privado, espacios de guardado con seguridad (Lockers). Además, cuenta con sector de cocina, Lavadero y tendedero y un salón de usos múltiples.\r\n3-El Area de Maternidad, se construyó un área de atención y admisión de pacientes, con estación de enfermería, y se refaccionaron tres salas, logrando 6 salas de internación y 18 camas para pacientes de bajo riesgo, 3 salas de partos y sala de atención para recién nacidos, 7 boxes para el trabajo de parto, y estación para médicos, enfermeras y depósitos.\r\nUn sector de postparto con capacidad para cuatro camas con baño privado. Se reubicó el laboratorio de pesquisa neonatal.', '13 00 09 64', 1, 587090.46, 107, '2012-05-29 00:00:00', 1035518.71, 90, '2012-08-29 00:00:00', NULL, '2014-08-11 00:00:00', 28, 'Disp N° 26/12', 'Resol. N° 783/12', 'Resol. N° 790/14', 'Resol. N° 790/14', 'Dto. N° 2306/14', 'exist. Cubiuerto 2600 - a demoler 40 - a const. Cubierto 482 - a cont semicub 111 - a refaccionar 1070\r\n3ra amp plazo Resol. N° 1076/12 90 dias 27,11,12\r\n4ta amp plazo Resol. N° 185/14 60dias 31,01,13\r\nREDET (*) Varias\r\nExpte. N° 140-4597/12 de 69812,92 y Expte. N° 140-4598/12 de 24067,77 y Expte. N° 140-4599/12 de 44934,66 y Expte. N° 140-2283/12 de 953697,71 y Expte N° 140-2485/14 de $1539774,19', 0, NULL, 280360.63, 168940.