INSERT INTO `obras` VALUES (509, 'Prototipo de media complejidad  CAPS B° 500 viv', 'L.P. N° 3/11 - Resol. N° 395/11', 1537349.64, 24, 29, 3, 1, 240, 2, 4, 6, '2011-04-25 00:00:00', '2011-05-09 00:00:00', '2012-01-04 00:00:00', 'Este nuevo edifi cio posee una superfi cie cubierta de 372 m2 y cuenta con Hall de acceso, sala de Espera, S. U. M., Sanitarios Hombres - Mujeres, sanitarios para Discapacitados, Vestuario y baño para personal, Offi ce, Deposito de limpieza, Admisión- Administración- Archivo, Dirección, Enfermería y Vacunatorio, cinco Consultorios (tres en planta baja), Depósitos de Residuos Patológicos, Depósitos de Residuos Comunes, Deposito General, Sala de Maquinas y Torre Tanque- Cisterna\r\nEn planta alta se instalaron dos Consultorios, Laboratorio, sala de\r\nRayos X, Mamografía, Habitación para residentes, Estar Residentes, y baño para Discapacitados.\r\nTambién se proveyó de un ascensor para uso de personas con discapacidad.', '13 00 09 63', 1, 228092.15, 60, '2012-03-04 00:00:00', 0, 240, '2012-10-27 00:00:00', 100, '2013-02-04 00:00:00', 24, 'Resol. N° 93/12', 'Resol. N° 784/12', 'Resol. N° 408/13', 'Resol. N° 408/13', NULL, 'Prototipo Nivel Medio -- Sup. Cub 372m2 terreno 800m2\r\n(*) Varios Expte. N° 140-641/12 de $ 50,512,74 y Expte. N° 140-1197/13 de $ 147475,67', 0, NULL, 165290.56, 72807.46, 197988.41, 'Expte. N° 140-002361/11', 'Expte. N° 140-004811/11', '* Varios', 1, 2011, '140-004011/10', 1, 'Jun-10', 0, 13, 1073, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 1, '2013-08-31 00:00:00', 0, NULL);
INSERT INTO `obras` VALUES (510, 'Escuela de Policìas de Corrientes - 3a etapa - Refaccion', 'LP 11/12 - Resol. N° 665/12 - Resol. N° 905/12', 2131489.66, 27, 8, 3, 1, 240, 2, 4, 10, '2012-08-03 00:00:00', '2012-08-21 00:00:00', '2013-04-17 00:00:00', 'Siguiendo un orden de prioridades dictado por las urgencias, se\r\nintervinieron primero en los núcleos húmedos de los dormitorios de\r\ncadetes masculino y femeninos, se realizó una nueva Instalación Eléctrica, con su correspondiente conexión a red con pilar, se proveyeron sendos Tanques de Reserva y de Bombeo, y se realizaron conexiones de distribuciones de agua potable.\r\nPosteriormente, se intervino en los sectores de Jefatura y de Guardia, espacios que denotaban falta de mantenimiento en sus locales. Aquí, se reparó la cubierta del área de de jefatura y se refaccionó interiormente y en el sector de Guardia se realizó la colocación de una cubierta de chapa sobre la losa existente y se repararon los pisos interiores y exteriores, revoques, y pintura. Por último, se intervino en los sectores de Aulas, Comedor, Salón de Actos, Dormitorios de cadetes Mujeres, cadetes Varones, Dormitorios de Ofi ciales varones y Patios, espacios que requerían atención por falta de mantenimiento, sumándose la necesidad de reparar las cubiertas y cielorrasos.\r\nEn el área de Aulas y Dormitorio de cadetes mujeres y galería nueva en sector patio de las piedras, se cambiaron todos los pisos calcáreos por graníticos 30x30cm. Se refaccionó el piso del playón deportivo.\r\nSe colocó una cubierta de chapa sobre la losa existente en el sector de dormitorio de ofi ciales y se repararon pisos interiores y exteriores, revoques y pintura. Además, se construyó un offi ce y un baño nuevos y se refaccionaron las instalaciones sanitarias, cloacal y eléctrica.', '13 00 10 75', 1, 0, 0, NULL, 0, 0, NULL, 0, NULL, 10, NULL, NULL, NULL, NULL, NULL, 'terreno 1660,66 a const cub 271,55 semic 84,16 a demoler 16m2\r\n99,08% a la espera del ultimo certificado que cierre 100%', 0, NULL, 418525.75, 12932.47, 0, 'Expte. N° 140-3526/12', 'Expte. N° 140-1972/13', NULL, 1, 2012, '140-000990/12', 1, 'Dic-11', 0, 10, 712, 2184309.59, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, NULL, 0, NULL);
