INSERT INTO `obras` VALUES (517, 'Penal N° 1 - Celdas de Resguardo y Equipamiento Fijo', 'C.P. N° 5/10 - Resol. N° 163/11', 470876.55, 8, 8, 3, 1, 90, 3, 4, 1, '2011-03-14 00:00:00', '2011-04-01 00:00:00', '2011-06-30 00:00:00', 'A fin de cumplimentar con la Ley de Relaciones Familiares y Sociales y sus Decretos Reglamentarios, se realizaran Celdas Nuevas y Equipamiento Fijo. Las mismas consisten en la construcción de tres (3) cuartos para visita íntimas con sus cónyuges, ubicados fuera del pabellón de mínima seguridad y dentro del espacio de expansión destinado; los mismos serán de 6,75m2 y equipados cada uno con su núcleo húmedo de 2,97m2, lo que determina un total de 9,72m2 por cada cuarto.\r\nSe proveerán y colocaran camas metálicas en cada uno de los cuartos según se indica en detalles.\r\nEn el pabellón que consta de dos (2) sectores de alojamiento, se dispondrán cuchetas para los internos en el alojamiento A, tenido en cuenta las Condiciones Básicas de Habitabilidad de los Establecimientos Dependientes del Servicio Penitenciario Federal.\r\nSe proveerán cuchetas metálicas a ejecutarse según detalle de armado de cama, para utilizar un colchón estándar de 0,80 x 1,90m.\r\n	Asimismo se proveerán y colocaran armarios metálicos en el interior de las celdas, a razón de uno por interno sumando un total de 72 unidades.\r\n	En el área de expansión también se prevé equipamiento fijo: parillas de mampostería, mesas y bancos de Hº Aº, piletas y mesadas de Hº Aº.\r\n	Se ejecutara vereda perimetral en el bloque a construir y se ensanchara la existente del pabellón según se indica en planos. Se construirá una senda de acceso y de conexión entre los bloques (pabellón y cuartos)\r\n	Se realizaran los trabajos de Instalación Eléctrica y Sanitaria correspondientes a los trabajos a ejecutarse, y se completara la Instalación Eléctrica dentro del pabellón adicionándose dos ventiladores, tomas y bocas para TV. Se contempla la iluminación exterior según se indica en plano', '13 00 01 91', 1, 0, 0, NULL, 0, 0, NULL, 0, NULL, 25, NULL, NULL, NULL, NULL, NULL, 'sup terreno 2ha a cont cub 55m2 semicub 25 m2 fuente 10', 0, NULL, 14461.43, 39758.25, 0, 'Expte. N° 140-1322/11', 'Expte. N° 140-2410/11', NULL, 1, 2011, '140-004213/10', 1, 'Jun-10', 0, 10, 47, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, 0, NULL);
