INSERT INTO `obras` VALUES (546, 'Iglesia Santa Rita - Refaccion', 'Disp. N° 103/21', 5892668.85, 87, 45, 3, 1, 120, 1, 4, 2, '2021-07-01 00:00:00', '2021-08-02 00:00:00', '2021-11-30 00:00:00', 'Reparacion de fisuras y filtraciones existentes en cubiertas y muros. Reparacion y sellado de fisuras. Se repondrán los ápices de las torres laterales. Construccíon de un salón semicubierto y remodelación de escalinata de acceso. Puesta a punto de carpinterías y reubicación de unidades de AA. Pintura total del edificio.', '13 00 01 99', 1, 0, 120, '2022-03-31 00:00:00', 0, 30, '2022-04-30 00:00:00', 0, NULL, 34, 'Resol N° 21/21', 'Resol Nº 755/22', NULL, NULL, NULL, 'Bochi Artigas', 0, NULL, 745907.16, 171180.01, 57908.73, NULL, NULL, NULL, 1, 2020, NULL, 0, 'feb-21', 0, 10, 615, 5892668.85, 0, '2021-04-28 00:00:00', 'DEyP', '2021-04-23 00:00:00', '2021-04-09 00:00:00', 'Disp 219/22', 'Disp 16/23', '2022-06-13 00:00:00', '2023-01-18 00:00:00', 0, 0, NULL, 0, NULL);
