INSERT INTO `obras` VALUES (552, 'Comisaria 1a de Bella Vista - Refaccion y Ampliacion', 'C.P. N° 11/11 - Resol. N° 536/11', 934614.52, 83, 8, 3, 1, 270, 3, 2, 10, '2011-06-15 00:00:00', '2011-07-01 00:00:00', '2012-03-27 00:00:00', 'La Intervención consistió en la puesta en valor general, rescate de\r\nelementos de época y refuncionalización de espacios, jerarquizando el acceso principal y el vehicular y un tercer ingreso independiente y privado para uso de la vivienda del Sub comisario, corrigiendo el nivel de los pisos, subsanando las manchas de humedad, desprendiendo el revoque, procediendo al recambio de cubierta que evidenciaba filtraciones, se sustituyeron elementos estructurales en mal estado (vigas, clavadoras, entablonado, aislación hidráulica), se readecuaron sanitarios, se corrigieron pisos desnivelados, humedad de paredes, filtraciones y rajaduras, desprendimiento de revoques, se readecuaron las instalaciones eléctricas y sanitarias., dotando de bocas sufi cientes, tanto de energía como de datos.\r\nEn algunos casos se ejecutaron cielorrasos e instalaciones sanitarias y eléctricas y se proveyeron de artefactos sanitarios, para terminar con la pintura general del edificio.', '13 00 09 66', 21, 186253.46, 60, '2012-05-26 00:00:00', 0, 101, '2012-09-04 00:00:00', 0, NULL, 22, 'Resol. N° 646/12', 'Resol N° 2133/12', NULL, 'Resol N° 2133/12', NULL, 'a la espera de convenio p/ finalizar (15/5/14)', 0, NULL, 97228.7, 0, 0, 'Expte. N° 140-4271/11', NULL, NULL, 1, 2011, '140-005187/10', 1, 'Jun-10', 0, 10, 1023, 959092.01, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 1, '2013-09-12 00:00:00', 0, NULL);
