INSERT INTO `obras` VALUES (578, 'Hogar "Tia Amanda" y ECO-VIDAL - Refaccion Total', 'C.P. N° 13/11 - Resol. N° 647/11', 745789.21, 24, 31, 3, 1, 180, 3, 4, 12, '2011-08-24 00:00:00', '2011-09-08 00:00:00', '2012-03-06 00:00:00', 'La obra realizada consiste en la reparación y completamiento del tejido perimetral, con demolición de columnas en mal estado, tejido y ejecución de columnas de hº aº; revoques exteriores completos terminados al fi eltro; pintura de las fachadas con pintura al látex para exteriores de primera calidad y esmalte sintético en parasoles.\r\nLos juegos de niños se reparan, completan y pintan en su totalidad con esmalte sintético de primera calidad. Para el arenero se ejecuta cordón de hº aº revocado con mortero de cemento, donde se deposita la arena; contrapisos, vereda exterior, rampas para discapacitados; guarda sillas en sala de espera y comedor; piso alisado fratasado exterior; reparación de carpinterías existentes y colocación de faltantes ; rejas para ventanas que dan al exterior; iluminación exterior de las fachadas, patios y sectores de juego de niños.\r\nEl edifi cio del ECO-VIDAL se incluye le reparación integral, ajuste y\r\nrefacción funcional. Se completan los sectores faltantes de mampostería y revoque, se construye acceso, se amplía el aula; se mejora el office con nueva mesada y revestimiento de azulejos; en espera y admisión, se provee placard y se construye cielorraso y se completa mesada.\r\nSe refaccionaron las instalaciones eléctricas y sanitarias y se realiza pintura integral de los sectores, consultorio, sala de espera, circulación y aula.', '13 00 02 63', 1, 122211.56, 43, NULL, 0, 0, NULL, 0, NULL, 1, 'Resol. N° 2315/12', NULL, NULL, 'Resol. N° 2315/12', NULL, '(*) Expte. N° 140-1619/12 $34748,37 y Expte. N° 140-5786/12 de $67235,46', 0, NULL, 73317.84, 83299.38, 101983.83, 'Expte. N° 140-0117/12', 'Expte. N° 140-4757/11', 'Varios (*)', 1, 2011, '310-008705/10', 1, 'Jun-10', 0, 10, 38, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, NULL, 0, NULL);
