INSERT INTO `obras` VALUES (611, 'Refacción y Ampliacion Esc. N° 16 "Pedro Ferré" y JIN N° 8 - 2° Etapa', 'C.P. N° 7/12 - Resol. N° 449/12 - Resol. N°', 1188464.46, 33, 23, 3, 1, 300, 3, 2, 3, '2012-07-30 00:00:00', '2012-08-14 00:00:00', '2013-06-10 00:00:00', 'La intervención se realizó a la Escuela N° 16 y el Jardín N° 8\r\nSe ejecutaron trabajos de refuncionalización de los espacios, trabajos de reparación y sustitución de la infraestructura y patologías constructivas (técnicos) en estado de precariedad, se procedió a la Revalorización de la Fachada principal, dotándola de iluminación de realce escénico y reparando integralmente las carpinterías.\r\nSe Puso en Valor y se repararon carpinterías de las aulas, se proveyó e instaló un Corrector automático de factor de Potencia solicitado por la DPEC para ajustarse a la normativas vigentes de grandes consumidores, se Refaccionaron revoques y se ejecutó Pintura Integral de todos los Salones.\r\nSe construyó un depósito de mercaderías, contiguo a la torre del\r\ntanque de agua, y se amplió el aula 30 reconstruyendo una pared\r\naproximadamente a 2 m de la demolida dándole una mayor dimensión al espacio. También se proveyeron e instalaron dos electrobombas nuevas ejecutando a nuevo cañerías de bajadas y bebederos en el sector deportes.se refaccionaron integrarlmente las Veredas y se instalaron Rejas Divisorias entre el Jardín y la Escuela.', '13 00 08 70', 21, 0, 0, NULL, 0, 0, NULL, 0, NULL, 22, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 211222.78, 98697.22, 9851.92, 'Expte. N° 140-3483/13', 'Expte. N° 140-0585/13', 'Expte. N° 140-1633/13', 1, 2012, '140-005846/11', 1, 'Abr-11', 0, 13, 598, 1199762.87, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, NULL, 0, NULL);
