INSERT INTO `obras` VALUES (616, 'Hospital Escuela "J.F. San Martin" - Refaccion', 'L.P N° 14/12 - Resol N° 757/12 - Resol N° 1056/12', 1190970.51, 32, 25, 3, 1, 180, 2, 4, 6, '2012-09-05 00:00:00', '2012-09-25 00:00:00', '2012-03-24 00:00:00', 'Se procedió a retirar el cantero sobre la losa del subsuelo en el patio central del hospital, reemplazandolo por un contrapiso alivianado a nivel de piso existente, manteniendo intactos los tragaluces.\r\nSe refaccionaron los sanitarios en planta baja, incluyendo la demolición de tabiques divisorios de boxes, las instalaciones a nuevo junto con los artefactos y la adaptación de un baño de discapacitados.\r\nAdemás, fueron provistos todos los accesorios de los baños y las señaléticas correspondientes.\r\nAdemás se replantearon los accesos principales por calle Rivadavia, logrando jerarquizar, optimizar, y dotar de mayor seguridad a los ingresos y egresos al nosocomio. Se incluyó también, la refacción de los pisos en el patio de acceso y la construcción de un Tótem con las indicaciones de\r\nreferencia de las distintas áreas del Hospital.', '13 00 01 60', 1, 0, 60, '2013-05-23 00:00:00', 0, 90, '2013-08-23 00:00:00', 0, NULL, 34, 'Resol. N° 2375/12', 'Resol. N° 904/13', NULL, NULL, NULL, '(*) Expte. N° 140-3675/13 de $ 41060,51 y Expte. N° 140-3581/13 de $ 33783,39 - - - - -  Resol. N° 493/14 y Disp. N° 88/14 Aprueban demásia por $5648,65, absorbe la empresa', 0, NULL, 196025.1, 33390.57, 74843.9, 'Expte N° 140-4071/12', 'Expte. N° 140-3582/13', '* Varios', 1, 2012, '310-015103/10', 1, 'Dic-11', 0, 13, 12, 1222009.54, 0, '2012-07-10 00:00:00', 'DEyP', NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, 0, NULL);
