INSERT INTO `obras` VALUES (631, 'Museo de Bellas Artes "J.R.Vidal" - Refaccion y Ampliacion', 'C.P. N° 1/13 - Disp. N° 54/13 - Resol. N° 797/13', 1579984.71, 99, 30, 3, 1, 300, 3, 4, 3, '2013-06-13 00:00:00', '2013-07-08 00:00:00', '2014-05-04 00:00:00', 'Originalmente funcionó como vivienda particular de quién fuera gobernador de la Provincia de Corrientes en dos períodos a fines del s. XIX y comienzos del s. XX. Y posteriormente la provincia de Corrientes acepta el legado que establece en su testamento la Sra. Eloisa Torrent de Vidal, con la condición de crear un museo que perpetúe el nombre del Dr. Juan Ramón Vidal. \r\nEs una casona de estilo predominantemente neoclásico, y su construcción data del año 1860. \r\nProfesionales y técnicos de la Dirección de Planificación y Obras, relevaron el sitio y definieron el proyecto a realizar. \r\nAl inicio de esta intervención edilicia, se presentaron dos líneas de acción, por un lado un serie de trabajos de ampliación iniciados y paralizados que incluían trabajos en la cubierta, carpinterías, pisos, revoques cielorrasos, instalación sanitaria y eléctrica en general. \r\nPor otro lado, el edificio presentaba manifestaciones propias del paso del tiempo, haciéndose visible en la fachada de ingreso, con rajaduras del revoque, acumulación de contaminación urbana y falta de mantenimiento en la luminotecnia de la vereda. El patio interno presentaba el piso de mosaicos calcáreos rojos, desgastados por el constante transito. \r\nTambién se evidenciaban manchas de humedad en paramentos expuestos a la intemperie y problemas en carpinterías de chapa. \r\nEl piso de parquet de la sala de exposiciones tenía sectores hundidos, y en una de las salas de exposiciones se constata la falta el revestimiento del piso contando solo con un alisado de cemento. \r\nTambién la sala de conferencias, de gran valor histórico patrimonial y que actualmente se utiliza como administración y archivo, presenta una refacción parcial que deberá dar terminación con lustre a la boiseri. Además se reemplazarán las tablillas de parquet en mal estado y se dará terminación laqueada a toda la superficie.', '13 00 10 97', 1, 313544.61, 60, '2014-07-04 00:00:00', 0, 160, '2014-12-11 00:00:00', 90, '2015-03-10 00:00:00', 4, 'Resol. N° 335/14', 'Resol. N° 1213/14', 'Resol. N° 1258/14', 'Resol. N° 1258/14', NULL, NULL, 0, NULL, 214157.76, 277246.84, 126320.45, 'Expte N° 140-2772/13', 'Expte N° 140-0079/15', 'Expte N° 140-0181/15', 1, 2014, '140-005049/10', 1, 'Feb-13', 0, 10, 1084, 1605060.43, 0, '2013-04-29 00:00:00', 'DGC', '2013-04-18 00:00:00', NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, 0, NULL);
INSERT INTO `obras` VALUES (632, '.Guardería "Tamborcito de Tacuari" - Obra Nueva', 'n', 210000000, 132, 24, 3, 11, 180, 2, 4, 12, '2016-01-01 00:00:00', '2016-01-01 00:00:00', '2016-01-01 00:00:00', 'Demolicion completa de edificio existente y construccion a nuevo de 175 metros cuadrados con salas de 1 a 4 años y patios de juegos. Incluye provision e instalacion de mesadas pizarrones sistemas contra incendios, espejos y termotanques en locales sanitarios y señaletica identificatoria', '13 00 00 00', 1, 0, 0, NULL, 0, 0, NULL, 0, NULL, 50, NULL, NULL, NULL, NULL, NULL, 'elevado $ 2.325.341,54\r\nppto orig $2414987,64 a ago-15', 0, NULL, 0, 0, 0, NULL, NULL, NULL, 1, 2016, '140-002892/10', 1, 'jun-20', 0, 13, 9, 210000000, 0, NULL, 'DEyP', NULL, '2020-09-14 00:00:00', NULL, NULL, NULL, NULL, 0, 0, NULL, 0, NULL);
