INSERT INTO `obras` VALUES (636, 'Club Alvear - Refaccion y Ampliacion 3a etapa', 'AD N° 3/12 - Disp. N° 80/12', 355542.2, 31, 35, 3, 1, 60, 1, 4, 12, '2012-04-10 00:00:00', '2012-04-19 00:00:00', '2012-06-17 00:00:00', 'En el marco del Plan del Gobierno de la Provincia de Corrientes para la Recuperación y puesta a punto de Clubes y Sedes Deportivas y Sociales en toda la Provincia, la DPO desarrolló una intervención que contempló cuatro clubes de la ciudad de corrientes, el Club Atlético “Alvear”, el club “Pinguinos”, el Club “Hèrcules, y el Club Atlètico “el Tala”.\r\nEn todos, las prioridades fueron el cerramiento de la cancha principal y la posterior colocación de un nuevo piso deportivo de parquet.\r\nCon este objetivo, se construyeron tinglados cubiertos, y se realizaron cerramientos laterales con sus respectivos desagues. Además se construyeron y refaccionaron sanitarios y depósitos; además de la puesta a punto de las instalaciones sanitarias y eléctricas.\r\nTambién, en todos los casos, se construyó a nuevo una tribuna de hormigón armado con capacidades de entre 300 y 500 personas, las que se proyectaron y construyeron de acuerdo con las últimas normativas de seguridad, contemplando barandas y otros equipamientos necesarios para su completa funcionalidad. En todos los casos, se mejoraron los accesos principales, contemplando le reforma de los mismos con el objetivo de dotarlos de una imagen mejorada que le otorgue carácter e identidad. Una intervención completa a los edifi cios y predios de las instituciones a fi n de brindarles edifi caciones, servicios y equipamientos\r\nóptimos para el desarrollo de sus actividades.', '13 00 09 68', 1, 27947.86, 15, NULL, 0, 0, NULL, 0, NULL, 24, 'Resol N° 2269/12', NULL, NULL, 'Resol N° 2269/12', NULL, NULL, 0, NULL, 28629.6, 0, 0, 'Expte. N° 140-1127/12', NULL, NULL, 1, 2012, '140-000345/12', 1, 'Oct-11', 0, 10, 1009, 355542.2, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 1, '2012-02-22 00:00:00', 0, NULL);
INSERT INTO `obras` VALUES (637, 'Hospital Escuela "J.F. San Martin" - Recup. Sector residentes para int', 'L.P. N° 5/12 - Resol. N° 530/12 - Resol. N° 794/12', 1952000, 6, 25, 3, 1, 240, 2, 4, 6, '2012-07-25 00:00:00', '2012-08-10 00:00:00', '2013-04-06 00:00:00', 'En el sector internación, se amplió a diez salas de dos camas cada\r\nuna, más un sector de enfermería y depósitos, sumando 420 metros cuadrados. Se construyó además un nexo metálico entre la internación existente y este bloque nuevo.\r\nSe refaccionaron además, las instalaciones eléctricas y se dotó a las salas de internación de sistema de gases medicinales.', '13 00 01 60', 1, 371135.74, 70, '2013-06-15 00:00:00', 0, 0, NULL, 0, NULL, 19, 'Resol. N° 1306/13', NULL, NULL, 'Resol. N° 1306/13', NULL, NULL, 0, NULL, 336895.45, 30723.83, 0, 'Expte N° 140-0064/13', 'Expte N° 140-0063/13', NULL, 1, 2012, '140-005911/11', 1, 'Dic-11', 0, 13, 12, 1955408.22, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 1, '2013-06-27 00:00:00', 0, NULL);
