INSERT INTO `obras` VALUES (642, 'Escuela N° 606 y JIN N° 25 - Refaccion y Ampliacion', 'LP N° 12/12 - Resol. N° 663/12 - Resol N° 1091/12', 1409886.62, 24, 31, 3, 1, 180, 2, 4, 3, '2012-09-25 00:00:00', '2012-10-09 00:00:00', '2013-04-06 00:00:00', 'Se trató de la refacción de la Escuela, la construcción de un baño para discapacitados y la ampliación del J.I.Nº 25.\r\nLas tareas en las Escuela Nº 606 consistieron en la puesta a punto y refacción del edifi cio existente, se completaron, en los salones de la escuela, la colocación de pisos sobre el alisado de cemento existente, se demolió y colocó cielorraso de machimbre en las aulas que así lo requirieron.Se rellenaron de hormigón las columnas estructurales de hierro torsionado hasta la altura de 2,00 m; se procedió a pintar el exterior de toda la escuela y el jardín con pinturas para ladrillos a la vista y látex en los lugares revocados. En los baños existentes se demolieron dos piletones para reemplazarlos por mesadas con bachas. Además se ejecutaron los cerramientos necesarios dentro de uno de los sanitarios para adaptar un baño para discapacitados. Se conectó a la red cloacal;\r\ny se cambió a trifásica la provisión eléctrica del edifi cio. Se reubicó el tanque de bombeo; y se ejecutaron en el exterior, sobre el frente, un piso y un cerramiento con postes olímpicos. Se construyó una playa de estacionamiento para la escuela y para el Jardín y se jerarquizaron los accesos a las instituciones.\r\nLas tareas del J.I.Nº 25 consistieron en la construcción de un aula jardín y un baño con dos box sanitarios, además se reubicó el tanque de bombeo existente.', '13 00 10 73', 1, 205019.66, 45, '2013-05-21 00:00:00', 0, 50, '2013-07-10 00:00:00', 0, NULL, 34, 'Resol. N° 876/13', 'Resol. N° 1365/13', NULL, 'Nota N° 1495/12', NULL, '26.4.13 - AmpPlazo en tramite informa MG', 0, NULL, 222360.47, 8774.04, 71159.7, 'Expte. N° 140-4573/12', 'Expte. N° 140-0189/13', 'Expte. N° 140-4090/13', 1, 2012, '140-000015/12', 1, 'Ene-12', 0, 13, 926, 1424847.52, 0, '2012-07-11 00:00:00', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 1, '2013-08-26 00:00:00', 0, NULL);
