INSERT INTO `obras` VALUES (649, 'Corsódromo "Nolo Alías" - Reparaciones y  Mantenimiento', 'Disp. N° 185/20', 13106616.38, 142, 26, 3, 1, 180, 3, 4, 12, '2020-10-01 00:00:00', '2020-10-08 00:00:00', '2021-04-05 00:00:00', 'Reparaciones de problemas de cubiertas en tinglados de agrupaciones y comparsas (cenefas, canaletas, bajadas, dispositivos de ventilación). Reparación de veredas perimetrales. Reajuste, repaso y puesta a punto de todas las carpinterías existentes incluyendo paños vidriados. Reemplazo de puertas placas de sanitarios dañadas o deterioradas. Reemplazo de portón trasero por cerramiento de mampostería con \r\npuerta de emergencia de dos hojas, antipánico y cierre superior de chapa de H° G°. (en galpón de agrupaciones musicales). Reparación de sistema de sujeción y cierre de portón delantero de galpones de comparsas. Reparación de sistema de provisión de agua potable y desagües cloaca en núcleos sanitarios. Desobstrucción de pluviales, las cañerías, bocas de lluvias, canales y sumideros dentro\r\ndel predio. Reparación y puesta a punto de instalación eléctrica. Ejecución a nuevo de cielorrasos en sanitarios. Reajuste y puesta a punto de luminaria externa (Infraestructura). Limpieza de terreno y desmalezamiento de sectores. Limpieza y resellado de juntas de dilatación en pavimentos y calles. Repaso y reparacion de cerco perimetral. Provisión y colocación de matafuegos, carteles indicadores, detector de humo y baldes de arena. Pintura interior y exterior de los edificios.', '11 00 02 53', 1, 0, 0, NULL, 0, 0, NULL, 0, NULL, 40, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 1299377.99, 536302.14, 0, NULL, NULL, NULL, 1, 2019, '000-000000/12', 0, 'abr-20', 0, 10, 1209, 13342531.87, 0, '2020-07-30 00:00:00', 'DO', '2020-07-16 00:00:00', '2020-06-12 00:00:00', NULL, NULL, NULL, NULL, 0, 0, NULL, 0, NULL);
