INSERT INTO `obras` VALUES (652, 'Museo de la Cultura Guaranítica - Construccion de cubierta y otros', 'Resol. N° 1521/22', 74529714.62, 33, 6, 3, 1, 300, 2, 4, 3, '2022-12-02 00:00:00', '2023-02-15 00:00:00', '2023-08-14 00:00:00', 'La obra  del Museo GuaranÍtico, concretada la parte estructural  de hormigón armado, con un desarrollo del 95% de su estructura (bases-columnas-vigas y losas en planta baja y planta alta).\r\n\r\nSuperficie total proyectada : 2.256,46m2\r\n\r\nEn esta nueva etapa, de terminación,  se contemplara el cerramiento vertical de la misma (mampostería, panelería, cielorraso, etc);  la cubierta de techo, la infraestructura, aberturas y terminación de revoques y pinturas.\r\nEl edificio contará con áreas de recepción, cafetería, administración y oficinas, con zonas de servicios ( baños, depósito, etc.)\r\nCuenta con cuatro espacios cerrados para albergar diferentes exposiciones y muestras de la cultura Guaranitica.\r\nEn el patio posterior se  preverá un sector para el grupo electrógeno y sala de bomba - cisterna de agua.\r\nEn la planta alta alta se constituyen nuevos espacios de exposición de uso flexible (cerrados/ abiertos) donde se plantea cerramientos de panelerías móviles para generar diferentes ambientaciones -5 salas-.\r\nDicho nivel cuenta con baño para discapacitados. La planta alta propone un recorrido, con circulaciones y balconeos consecutivos a lo largo del partido, enriqueciendo el espacio arquitectónico, con el juego de llenos y vacios.', '13 00 01 64', 1, 0, 60, '2023-10-13 00:00:00', 0, 0, NULL, 0, NULL, 53, 'Resol. N° 1706/23', NULL, NULL, NULL, NULL, NULL, 0, NULL, 22186109.02, 3588379.8, 3891479.5, NULL, NULL, NULL, 0, 2019, NULL, 0, 'Jul-22', 0, 10, 1503, 75580280.52, 1, '2022-12-02 00:00:00', 'DEyP', '2022-10-28 00:00:00', '2022-08-08 00:00:00', 'Disp. N° 4/24', NULL, '2023-12-21 00:00:00', NULL, 0, 0, NULL, 0, NULL);
