INSERT INTO `obras` VALUES (656, 'Asociacion Centro del Discapacitado "Virgen de Loreto" - Obra Nueva', 'Resol. N° 405/20', 27410570.66, 9, 30, 3, 1, 360, 2, 17, 12, '2020-09-16 00:00:00', '2020-11-02 00:00:00', '2021-10-27 00:00:00', 'Construcción de una sede de 650 metros cuadrados, que incluye sector administrativo, Sala de Kinesiología, dos aulas, Núcleo Sanitario, Lavadero, Cocina, Deposito General y de Educación Física, SUM, dos Talleres Especiales y Patio de Formación exterior.', '11 00 02 87', 7, 0, 90, '2022-01-27 00:00:00', 0, 90, '2022-04-28 00:00:00', 300, '2023-02-23 00:00:00', 41, 'Resol N° 676/21', 'Resol N° 19/21', 'Resol Nº1528/22', NULL, NULL, NULL, 0, NULL, 3060284.6, 3155133.12, 1290879, NULL, NULL, NULL, 0, 2020, NULL, 0, 'Mar-20', 0, 10, 880, 27720137.5, 0, '2020-08-06 00:00:00', 'DEyP', '2020-07-13 00:00:00', '2019-10-03 00:00:00', 'Disp. N° 9/24', NULL, '2023-12-21 00:00:00', NULL, 0, 0, NULL, 0, NULL);
INSERT INTO `obras` VALUES (657, 'UTI - Hospital Escuela "J.F. de San Martin" - Refaccion y Ampliacion', 'Resol. N° 235/17', 18080712.13, 30, 26, 3, 1, 300, 2, 4, 6, '2017-07-12 00:00:00', '2018-03-15 00:00:00', '2019-01-09 00:00:00', 'Se intervienen 760 metros cuadrados del sector de planta alta del hospital, donde actualmente se encuentra el Servicio de Hemodiálisis y dos habitaciones de internación, para desarrollar la Unidad de Terapia Intensiva (UTI) y la Unidad de Terapia Intermedia (UTIm) sobre Av. 3 de Abril. Además se llevará adelante una intervención sobre un sector de la Unidad Coronaria (UCO), para generar una sala de reuniones para médicos con sus servicios de office y sanitarios, más un depósito, y modificaciones al área de recepción\r\nEl sector de Terapia Intensiva ampliará su capacidad con 12 camas adicionales más un box para aislados con baño privado, una estación central de enfermería con visibilidad directa a todas las camas y dos estaciones auxiliares, baño para discapacitados y sanitario común con ducha. El Sector de Terapia Intermedia contará con una capacidad para 6 camas adicionales más un box para aislados, y una estación de enfermería dedicada para este sector exclusivamente. \r\nEl sector médico, quedará separado por la circulación semirrestringida cuyo cielorraso será reemplazado completamente y proveerá un adecuado acceso a instalaciones a modo de pleno técnico y de servicio. Contará además el sector, con oficina para el Jefe de la Unidad, dormitorios para médicos de guardia, depósitos, oficina para secretarios y una unidad de Laboratorio exclusiva para el sector UTI.\r\n Cada cama contará con su cabezal de gases y se destinarán dos áreas centrales para la colocación de los equipos especiales. Se realizará pintura completa del sector intervenido, utilizando pintura epoxi lavable.', '96 00 01 59', 1, 3559532.99, 90, '2019-04-09 00:00:00', 0, 84, '2019-07-02 00:00:00', 150, '2019-11-30 00:00:00', 28, 'Resol N° 611/18', 'Resol N° 34/19', 'Resol N° 604/19', 'Resol. N° 34/19', NULL, '(*) Varios Exptes. 140-002609/17 de $ 2,404,008,51 y 140-002256/18 de $864531,89 y 140-000970/19 de $2267230,51 y 140-000969/19 de $508870,14 y 140-001088/19 de $702341,78 y 140-003287/19 de $723761,01 y 140-003289/19 de $535582,87', 0, NULL, 759907.92, 470194.57, 528788.97, NULL, NULL, '* Varios', 1, 2018, NULL, 1, 'nov-16', 0, 13, 12, 18269239.62, 0, '2017-05-11 00:00:00', 'DEyP', '2017-04-11 00:00:00', '2015-07-06 00:00:00', 'Disp. N° 41/20', 'Disp. N° 338/20', '2019-12-20 00:00:00', '2020-10-23 00:00:00', 0, 0, NULL, 0, NULL);
INSERT INTO `obras` VALUES (658, 'Centro de Atencion para personas con Discapacidad – Obra Nueva', 'Resol. N°  1428/22', 91730867.02, 33, 30, 3, 2, 360, 2, 15, 12, '2022-11-04 00:00:00', '2022-12-01 00:00:00', '2023-11-25 00:00:00', 'Construccion de edificio de 950 metros cuadrados para la atencion de personas con discapacidad. Incluye areas administrativas, de rehabilitacion, de diagnóstico y aprendizaje, SETIN y Torre Tanque y Cisterna.\r\nPersonas con discapacidad desde 45 días hasta adultos mayores, en las áreas de Salud, Educación, recreativa, con salas pedagógicas, gabinetes sicológicos,talleres huertas, área administrativa, sanitarios, biblioteca, cocina-taller, lavadero-taller, salas de estimulación temprana, piscina climatizada, sala de estimulación con aparatos, enfermería, huerta, espacio para equinoterapia y para terapia con caninos, etc.', '13 00 01 56', 8, 0, 180, '2024-05-23 00:00:00', 0, 180, '2024-11-19 00:00:00', 0, NULL, 58, 'Resol. N° 208/24', 'Resol. N° 1714/24', NULL, NULL, NULL, 'Ppto completo a feb-21 91778272,88\r\n\r\nOBRA LICITADA EN 2021 pero la empresa renuncia a su ejecucino por lo que se debe inicira el proceso licitatorio nuevamente. (1/6/22)', 0, NULL, 23193196.85, 5554178.1, 3888386.03, NULL, NULL, NULL, 0, 2021, NULL, 0, 'Jul-22', 0, 10, 1462, 93212952.97, 0, '2022-10-18 00:00:00', 'DC', '2022-09-30 00:00:00', '2022-09-07 00:00:00', NULL, NULL, NULL, NULL, 0, 0, NULL, 0, NULL);
