INSERT INTO `obras` VALUES (666, 'Hospital Escuela "Jose F. de San Martin" - Tratamiento Cloacal y Pluvi', 'Disp. N° 84/19', 8382709.98, 121, 25, 3, 1, 150, 3, 4, 6, '2019-05-28 00:00:00', '2019-06-12 00:00:00', '2019-11-08 00:00:00', 'Intervención completa en el sistema cloacal y pluvial además de algunas cubiertas de losas que confluyen al sistema de desagües y que deben ser intervenidas.\r\nSe procederá a la desobstrucción de desagües pluviales, recambio de cañerías con pérdidas o deterioradas, construcción de nuevas bocas de acceso, colocación de tapas ciegas en locales con piletas de piso o bocas de accesos, reconducción de aguas de lluvias a canaletas y construcción de nuevos sumideros. Limpieza de cámaras de inspección, bóvedas y cañerías.\r\nEn las cubiertas de losas, limpieza y desobstrucción de desagües y embudos, reparación, desobstrucción y calafateo de caños y reparación general del sistema pluvial en distintos locales internos. Retiro de membranas deterioradas, provisión e instalación de canaletas y bajadas en las cubiertas de todo el edificio, re impermeabilización con membrana y nuevo tratamiento en todo el patio central. Normalizar instalación eléctrica superior, en mal estado o en estado de precariedad y reconstrucción de cámaras de inspección de 60 x 60 cm', '13 00 02 60', 1, 0, 0, NULL, 0, 0, NULL, 0, NULL, 38, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 1391486.49, 93458.02, 0, NULL, NULL, NULL, 0, 2019, NULL, 1, 'ene-19', 0, 10, 12, 8644875.2, 0, '2019-05-02 00:00:00', 'DEyP', '2019-04-15 00:00:00', '2019-03-29 00:00:00', NULL, NULL, NULL, NULL, 0, 0, NULL, 0, NULL);
