INSERT INTO `obras` VALUES (677, 'Asociacion Hogar Rural - Terminacion y Refaccion', 'Disp. N° 164/19', 10430160.42, 147, 25, 3, 1, 210, 3, 11, 12, '2019-10-22 00:00:00', '2019-11-06 00:00:00', '2020-06-03 00:00:00', 'Terminación y refacción de todo el edificio.\r\nReparación de fachada incluyendo de aberturas existentes. Recambio de piso y Cielorraso en algunos sectores y de Revestimientos de madera y cielorrasos en otros. Reconstrucción de revoques. Provisión de 40 roperos individuales. Demolición y reconstrucción de Sanitario existente. Terminación de estructura existente para torre tanque ubicando un lavadero en planta baja, sala de bombas y garrafa de gas en el primer nivel y tanques de reserva en el ultimo.\r\nReemplazo de pisos en galería por losetas graníticas. Reconstrucción del 100% de la cubierta en sectores deteriorados. Construcción a nuevo de la instalación de agua fría y caliente e instalación eléctrica. Limpieza y desobstrucción de instalación cloacal. Pintura final de todo el Establecimiento.', '10 00 02 69', 18, 2086032.08, 64, '2021-02-18 00:00:00', 0, 0, NULL, 0, NULL, 54, 'Resol. N° 948/20', NULL, NULL, 'Resol. N° 948/20', NULL, NULL, 0, NULL, 1555701.74, 25641.93, 1423589.59, NULL, NULL, NULL, 0, 2019, NULL, 1, 'jul-19', 0, 10, 1188, 10576774.46, 0, '2019-09-17 00:00:00', 'DEyP', '2019-09-04 00:00:00', '2019-08-23 00:00:00', NULL, NULL, NULL, NULL, 0, 0, NULL, 0, NULL);
