INSERT INTO `obras` VALUES (693, 'Subsecretaria de Trabajo - Refaccion', 'Disp. N° 18/19', 1833117.09, 143, 6, 3, 1, 90, 1, 4, 9, '2019-02-15 00:00:00', '2019-03-18 00:00:00', '2019-06-15 00:00:00', 'Demolición y reconstrucción a nuevo de cubierta y cielorraso de galería, canaletas y bajadas pluviales en mal estado; Pisos y contrapisos de sectores sanitario, pasillo y patio en planta baja y repaso y verificación de funcionamiento del sistema de desagüe cloacal. Pintura de todo el edificio previa reparación de revoques y fisuras en cielorrasos y paredes.', '11 00 02 80', 1, 362324.82, 60, '2019-08-14 00:00:00', 0, 30, '2019-10-20 00:00:00', 0, NULL, 44, 'Resol N° 269/19', 'Resol. N° 600/19', NULL, 'Nota 140/19', NULL, 'Subsec de trabajo San Juan 1317 - antiguo expte 524-004448/12', 0, NULL, 331978.35, 95994.57, 62810.73, NULL, NULL, NULL, 1, 2019, NULL, 1, 'jun-18', 0, 10, 1245, 1833117.09, 0, '2019-01-25 00:00:00', 'DEyP', '2019-01-24 00:00:00', '2015-09-15 00:00:00', NULL, NULL, NULL, NULL, 0, 0, NULL, 0, NULL);
