INSERT INTO `obras` VALUES (697, 'Establecimiento Penal N° 1  - Vallado Pabellon Central', 'LP N° 19/12 - Resol N° 2333/12 - Resol N° 2493/12', 1812392.11, 24, 26, 3, 1, 180, 2, 4, 1, '2012-12-19 00:00:00', '2013-02-28 00:00:00', '2013-08-27 00:00:00', 'En esta etapa se intervendrá el Pabellón Central, para mayor seguridad del predio.\r\nSe harán trabajos para la subdivisión de los diferentes pabellones y la ejecución a nuevo de un núcleo sanitario en el pabellón Nº 3.\r\nSe cambiara el ingreso a los Pabellones Nº 2 y 3, generando los nuevos accesos por el exterior adaptando las rejas existentes. Tapiar los vanos actuales del pabellón central.\r\nEjecutar a nuevo un bloque sanitario para el pabellón 3, lateral al ingreso nuevo sobre el patio.\r\nEn el núcleo sanitario realizar un repaso general de la instalación, de ser necesario, reemplazo de cañerías de provisión de agua y de desagüe, griferías y artefactos. Ejecución de vallado de cierre perimetral sobre el muro.\r\nRepaso de los sanitarios en cada pabellón.\r\nEjecutar vallados para subdividir el patio y así evitar que los internos de diferentes pabellones se mezclen.\r\nGenerar un pasillo con vallados para conectar los diferentes pabellones con la cancha de futbol y el área de educación.', '15 00 00 03', 1, 300971.45, 46, '2013-10-12 00:00:00', 0, 0, NULL, 0, NULL, 25, 'Nota N° 115/13', NULL, NULL, 'Nota N° 115/13', NULL, NULL, 0, NULL, 32772.18, 24562.49, 75965.64, 'Expte N° 140-0201/13', 'Expte N° 140-3082/13', 'Expte N° 140-2820/13', 1, 2013, '225-000611/12', 0, 'jun/12', 0, 13, 47, 1827392.11, 0, '2012-11-27 00:00:00', 'DEyP', NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, NULL, 0, NULL);
