INSERT INTO `obras` VALUES (735, 'Hogar de Ancianos "Adelina Bibbio de Ezcurra" - Refaccion', 'Resol. N° 794/20', 16987605.5, 149, 23, 3, 16, 360, 3, 7, 12, '2020-11-30 00:00:00', '2021-02-01 00:00:00', '2022-01-26 00:00:00', 'Construcción de baños para habitaciones en el área femenina y el sector del lateral izquierdo.\r\nSe adecuara un lugar para la administración, consultorio y enfermería incluyendo sanitarios.\r\nSe refaccionarán las cubiertas del sector de capilla y habitaciones de mujeres, sector lateral de comedor, cocina y habitación de hombres. Repaso y reparación de canaletas.\r\nColocación de piso a nuevo en el sector de habitaciones de mujeres y hombres, consultorio, enfermería baños área administrativa, lavadero, y comedor hombres.\r\nReparación de fisuras y revoques en paredes, en sectores deteriorados, reparación o recambio de carpinterías, cierre con carpintería de aluminio en galería posterior donde irán las habitaciones de los hombres; Repaso instalación eléctrica y Pintura exterior e interior de paredes.', '11 00 02 80', 15, 0, 300, '2022-11-23 00:00:00', 0, 0, NULL, 0, NULL, 58, 'Resol N° 1362/21', NULL, NULL, NULL, NULL, 'Noelia Rodriguez, Proyectista - Elias Abad 1900\r\n\r\nDisp. N° 462/22 Economia de Obra -$5.018.600,32', 0, NULL, 7005247.7, 759867.55, 600996.63, NULL, NULL, NULL, 1, 2019, NULL, 0, 'dic-19', 0, 10, 1415, 17010230.77, 0, '2020-08-04 00:00:00', 'DC', '2020-05-22 00:00:00', '2020-03-16 00:00:00', NULL, NULL, NULL, NULL, 0, 0, NULL, 0, NULL);
