INSERT INTO `obras` VALUES (743, 'Aeropuerto "Dr. Fernando P. Niveyro" - Refaccion Pórtico acceso', 'Disp. N° 61/20', 1842699.03, 104, 23, 3, 1, 120, 1, 4, 7, '2020-05-19 00:00:00', '2020-06-16 00:00:00', '2020-10-13 00:00:00', 'Refaccion general del pórtico de acceso al predio. Se colocará cielorraso , se dotará de iluminación del sector interno y de ambas caras de acceso y egreso. Se renovarán las letras corpóreas y se adicionarán dos tótems informativos. Se colocarán semáforos de alto/pase para la casilla de entrada y se dejarán previstas cañerías de tendidos de cable para instalación de cámaras de seguridad y vigilancia. Se instalarán reductores de velocidad y pintura demarcatoria en pavimento. Por último se finalizará con pintura general.', '11 00 02 56', 1, 0, 0, NULL, 0, 0, NULL, 0, NULL, 39, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 162353.47, 123481.77, 0, NULL, NULL, NULL, 1, 2019, NULL, 0, 'dic-19', 0, 10, 87, 1842699.03, 0, '2020-03-05 00:00:00', 'DIR', '2020-03-06 00:00:00', '2020-02-13 00:00:00', NULL, NULL, NULL, NULL, 0, 0, NULL, 0, NULL);
