INSERT INTO `obras` VALUES (749, 'Establecimiento Penal N° 1 - Pabellon Central  Refaccion y Ampliacion', 'C.P. N° 4/13 - Resol. N° 1057/13', 1362627.85, 91, 6, 3, 1, 180, 3, 4, 1, '2013-08-14 00:00:00', '2013-09-02 00:00:00', '2014-02-28 00:00:00', 'Los trabajos a realizar comprenden:\r\na)	Grupo Sanitario Pabellón Central: ejecución de una nueva red de desagües cloacales y red de provisión de agua fría y agua caliente; reposición total de inodoros a la turca; provisión de duchas con la incorporación de agua caliente provista por termo-tanque eléctrico, ejecución de revoques interiores impermeables terminados a la llana metálica y pintadas con pintura tipo epoxi, provisión de piletones, ejecución de nuevos pisos en todo el Grupo Sanitario; ejecución de un nuevo techo (estructura metálica de correas metálicas, cubierta de chapas galvanizadas, zinguería y caños de lluvia), cielorraso suspendido a la cal con aislación térmica, reposición de aberturas en las Duchas e Inodoros. Los pisos del Grupo Sanitarios serán de mosaicos graníticos de 30x30 cm, y en los Aire y Luz, serán de cemento alisado. Las carpinterías serán metálicas respondiendo a normas de seguridad. Los ventiluces deberán llevar policarbonato transparente de 4 mm.\r\nB)	Refacción Integral Instalación Eléctrica del Pabellón Central y de Pabellones 9 y 10: la instalación será totalmente embutida a fin de evitar descargas eléctricas, procediéndose a un nuevo cableado de las líneas eléctricas como las de televisión por cable; reposición de módulos, artefactos y luminarias de bajo consumo. \r\nC)	Refacción total del techo del patio cubierto del Pabellón Central: demolición del techo existente y ejecución de uno nuevo compuesto por estructura metálica y cubierta de chapas galvanizadas.\r\nD)	Construcción de Grupo Sanitario: por razones de  Seguridad Interna será destinado a los Internos del Pabellón Nº 3, el cual contará con lavatorios, inodoros y duchas con agua caliente. Mampostería de ladrillos comunes, revoque exterior común a la cal, revoques interiores impermeables terminados a la llana metálica y pintadas con pintura tipo epoxi, pisos de mosaicos graníticos de 30x30 cm, cubierta de chapas galvanizadas sobre estructura de correas metálicas y cielorraso de metal desplegado. Las carpinterías serán metálicas respondiendo a normas de seguridad. Los ventiluces deberán llevar policarbonato transparente de 4 mm.', '15 00 00 03', 1, 0, 90, '2014-05-30 00:00:00', 0, 0, NULL, 0, NULL, 25, 'Nota N° 127/14', NULL, NULL, NULL, NULL, 'paga mrio de gobierno\r\ncon Resol 381/14', 0, NULL, 162207.15, 55313.32, 18505.15, 'Expte 140-4092/13', 'Expte 140-1309/14', 'Expte 140-1367/14', 1, 2014, '140-001463/13', 1, 'Feb-13', 0, 10, 47, 1394706.09, 0, '2013-06-18 00:00:00', 'DEyP', '2013-06-06 00:00:00', '2014-05-16 00:00:00', NULL, NULL, NULL, NULL, 0, 0, NULL, 0, NULL);
