INSERT INTO `obras` VALUES (812, 'Escuela Nº 72 - Ma. Elena Araujo de Bernadel - Refaccion', 'n', 10144176.63, 132, 24, 3, 11, 240, 2, 41, 3, '2015-01-01 00:00:00', '2015-01-01 00:00:00', '2015-01-01 00:00:00', 'Reemplazo total de la cubierta, incluyendo su estructura, manteniendo las cabreadas en buen estado.\r\nReconstrucción de piso y contrapiso hundidos en sanitario varones, reparación cañería y cámara. Reparación de piso en galería. Reconstrucción de revoques en mal estado. Reconstrucción de cielorrasos. Ejecución de canaleta pluvial perimetral. Ejecución tejido olímpico perimetral en patio de jardín de infantes. Repaso y puesta a punto de instalación sanitaria. Reparación de sanitario dirección. Nuevo pozo absorbente y cámara séptica. Instalación eléctrica a nuevo, en aulas donde se reemplacen los cielorrasos y revisión general. Provisión y colocación de ventiladores de pared y techo. Provisión y colocación de tableros para bomba y seccionales. Pintura general en muros, cielorrasos y carpinterías. \r\nFumigación y limpieza de tanque. Reemplazo de pizarrones. Provisión y colocación de matafuegos y luces de emergencia', '13 00 00 00', 25, 0, 0, NULL, 0, 0, NULL, 0, NULL, 31, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 0, 0, 0, NULL, NULL, NULL, 1, 2017, '140-000872/13', 0, 'ene-17', 0, 13, NULL, 10144176.63, 0, NULL, 'DEyP', NULL, '2017-03-07 00:00:00', NULL, NULL, NULL, NULL, 0, 0, NULL, 0, NULL);
