INSERT INTO `obras` VALUES (848, 'Instituto Superior de Servicios Sociales - Refaccion General', 'Resol. N° 659/18 - Resol. N° 20/19', 4812565.74, 108, 26, 3, 1, 360, 3, 4, 3, '2019-02-04 00:00:00', '2019-03-01 00:00:00', '2020-02-23 00:00:00', 'Comprende tareas de adecuación y mantenimiento general del edificio en cinco plantas y azotea.\r\nLos trabajos incluyen reemplazo de pisos en sectores deteriorados, reforzando contra-pisos materializando juntas de dilatación. Se atenderán filtraciones en azotea, y otras que se producen en paños de carpinterías. Se sanearan núcleos húmedos de cada piso completando faltantes de instalaciones o equipamientos, incluyendo carpinterías de boxes deterioradas.\r\nSustitución de cielorrasos deteriorados, completamiento de cupertinas en cargas de cubierta, y se cubrirá la azotea con cubierta de chapas onduladas sobre una estructura de hierro redondo reticulada liviana, además de realizar un tratamiento de impermeabilización del solado de  la misma. Se reforzaran las instalaciones contra-incendio, jerarquización de la entrada principal del edificio y pintura general de las instalaciones.', '11 00 01 65', 1, 678875.46, 73, '2020-10-13 00:00:00', 0, 0, NULL, 0, NULL, 39, 'Resol. N° 454/20', NULL, NULL, 'Resol. N° 454/20', NULL, NULL, 0, NULL, 947367.73, 164985.87, 76114.18, 'Expte N° 140-515/19', 'Expte N° 140-1708/19', '140-001999/19', 1, 2019, '140-001451/16', 1, 'Jul-18', 0, 12, 738, 4818270.56, 0, '2018-11-29 00:00:00', 'DO', '2018-10-22 00:00:00', '2016-06-02 00:00:00', 'Disp. N° 307/19', NULL, '2019-12-09 00:00:00', NULL, 0, 0, NULL, 0, NULL);
