INSERT INTO `obras` VALUES (869, 'Centro de ex Combatientes de Malvinas - Obra Nueva LAV', 'Disp. N° 105/20', 8671697.16, 13, 27, 3, 1, 300, 3, 16, 12, '2020-07-13 00:00:00', '2020-09-14 00:00:00', '2021-07-10 00:00:00', 'Construcción a nuevo de sede social de 186 metros cuadrados, con \r\nSalón de Usos Múltiples (SUM) amplio, y ventilado, oficina administrativa, sector de servicios que cuenta con baños públicos tanto para dama como para caballeros, también se construye un baño para discapacitados con todo el equipamiento necesario; cocina y área de quincho con parrilla y mesada con bacha.\r\nAdemás, se construirá una torre-tanque de reserva, y cerrando el predio, sobre la vereda, se erigirá un cerco con muretes de mampostería y rejas metálicas. Se prevee un ingreso vehicular sobre la fachada lateral de la sede.', '11 00 02 85', 19, NULL, 0, NULL, 0, 0, NULL, 0, NULL, 41, NULL, NULL, NULL, NULL, NULL, 'Ppto orig $3611997,2 a oct-16', 0, NULL, 1607872.23, 272954.01, 725420.58, NULL, NULL, NULL, 1, 2016, NULL, 0, 'dic-19', 0, 10, 1454, 8859522.9, 0, '2020-05-28 00:00:00', 'DEyP', '2020-05-18 00:00:00', '2016-12-07 00:00:00', 'Disp. N° 336/21', NULL, '2021-11-24 00:00:00', NULL, 0, 0, NULL, 0, NULL);
