INSERT INTO `obras` VALUES (886, 'Sociedad Italiana de Socorros Mutuos - Restauración y Puesta en Valor', 'C.P. N° 8/18 - Resol. N° 590/18 - Resol. N° 720/18', 6558000, 29, 25, 3, 1, 240, 3, 11, 12, '2018-11-12 00:00:00', '2019-01-07 00:00:00', '2019-09-04 00:00:00', 'Demolición de losa de bovedilla en ala lateral y ejecución de losa de encofrado perdido para azotea accesible provista de una escalera metálica caracol restaurada además de la ejecución de cielorraso con junta tomada.\r\nReemplazo de pisos en sanitarios, sala de máquina, baño para discapacitados en planta baja y en galería,  azotea y  sanitarios de la planta alta.\r\nRevestimiento cerámico, colocación de mesadas y placas divisorias de mármol, provisión y colocación de carpinterías  en sanitarios.\r\nEjecución a nuevo de cubierta  de chapas, estructura de techo metálica, zinguería y cielorrasos de placa de roca de yeso con junta tomada, correspondientes al ala lateral.. En el sector frontal, solo se reemplazara la chapa existente y las correas en estado de deterioro, junto con las babetas y canaletas. En el bloque sanitario se realizara una intervención integral, cubierta metálica, estructura de techo, aislación y zinguería.\r\nPicado y reconstrucción de revoque interior y exterior para tratamiento contra humedades ascendentes en planta baja. Instalaciones eléctrica y sanitaria completas. Provisión y colocación de artefactos sanitarios, griferías y accesorios.\r\nEjecución de cielorraso aplicado bajo losa y sectores que así lo requieran por mal estado de conservación (salón principal, secretaria, hall de escalera, sanitarios  y galería  de la planta alta)', '11 00 02 76', 18, 0, 0, NULL, 0, 0, NULL, 0, NULL, 23, NULL, NULL, NULL, NULL, NULL, '(*) Varios 140-001207/19 de $178.875,56 y 140-002001/19 de $86302,76', 0, NULL, 1219423.66, 227801.02, 178875.56, '140-0153/19', '140-0923/19', '* varios', 1, 2019, '140-000415/12', 1, 'may-18', 0, 12, 173, 6684551.77, 0, NULL, 'DEyP', '2018-09-20 00:00:00', '2018-06-26 00:00:00', 'Disp. N° 304/19', NULL, '2019-11-27 00:00:00', NULL, 0, 0, NULL, 0, NULL);
