INSERT INTO `obras` VALUES (890, 'Escuela jardín de Infantes N° 16 "Vicky Jean Navajas" - Refaccion', 'Disp. N° 218/18', 1675838.78, 103, 1, 3, 1, 150, 1, 33, 3, '2018-10-24 00:00:00', '2018-11-07 00:00:00', '2019-04-06 00:00:00', 'Se demolerá una losa para posibilitar que el techo de la cocina escurra. Se ejecutarán los trabajos necesarios que permitan conducir las aguas pluviales hasta la calzada, canalización mediante.\r\nSobre la losa del acceso se procederá a la limpieza completa de la misma para posteriormente proceder a su impermeabilización. En la cubierta de chapas se cambiarán la totalidad de los elementos de fijación, canaleta y desagües. Se colocarán babetas perimetrales de chapas en el perímetro de la losa y en el de la cubierta de la cocina.\r\nEn el espacio interior que quedará abierto a partir de la demolición de la losa referida, se generará un patio descubierto ejecutando un contrapiso y piso de mosaicos graníticos, más un cerramiento metálico superior.\r\nSe contempla la ejecución de la instalación eléctrica nueva completa, con excepción de las cañerías que serán reutilizadas. El cielorraso de machimbre existente en la cocina será reemplazado por cielorrraso de yeso junta tomada.\r\nSe realizará la conexión de agua desde línea municipal hasta el tanque de bombeo  que se ubicará en el patio trasero, al pie de una estructura métalica a construir para el tanque de reserva a proveer. De allí se hará la distribución a la acometida existente actual. La obra concluirá con la pintura completa del edificio', '11 00 01 64', 9, 205326.61, 35, '2019-10-07 00:00:00', 0, 0, NULL, 0, NULL, 4, 'Resol N° 517/19', NULL, NULL, 'Resol N° 517/19', NULL, NULL, 0, NULL, 248041.79, 42218.26, 115796.79, NULL, NULL, NULL, 1, 2018, '140-000609/17', 1, 'Jun-18', 0, 12, 1167, 1675838.78, 0, '2018-09-27 00:00:00', 'DO', '2018-09-27 00:00:00', '2017-08-14 00:00:00', 'Nota N° 360/19', 'Disp. N° 303/19', '2019-05-16 00:00:00', '2019-11-29 00:00:00', 0, 0, NULL, 0, NULL);
INSERT INTO `obras` VALUES (891, 'C.D.I. "Rosa Guarú" - Refaccion', 'Disp. N° 199/18', 6924781.59, 144, 45, 3, 1, 150, 3, 4, 12, '2018-12-14 00:00:00', '2019-02-01 00:00:00', '2019-06-30 00:00:00', 'Refacción general del edificio, construyendo una cubierta de chapa sobre la losa existente y reacondicionando a nuevo locales sanitarios, aulas, galerías y senderos. Los trabajos de reacondicionamiento incluyen tratamientos por eflorecencias, reconstrucción de revoques, revestimientos y cielorrasos, recambio de artefactos y pintura general.', '13 00 01 92', 1, 1384656.59, 60, '2019-08-31 00:00:00', 0, 48, '2020-01-14 00:00:00', 0, NULL, 13, 'Resol. N° 646/19', 'Resol. N° 831/19', NULL, 'Resol. N° 831/19', NULL, NULL, 0, NULL, 1308806.64, 0, 0, NULL, NULL, NULL, 1, 2018, '953-002529/14', 1, 'Jun-18', 0, 12, 363, 6729623.5, 0, '2018-10-11 00:00:00', 'DEyP', '2018-09-20 00:00:00', '2017-08-14 00:00:00', 'Disp. N° 171/22', 'Disp. N° 28/22', '2020-06-08 00:00:00', '2022-03-03 00:00:00', 0, 0, NULL, 0, NULL);
