INSERT INTO `obras` VALUES (895, 'Casa del Jubilado Provincial - Edificio Nuevo', 'Disp. N° 174/17 - Resol N° 668/17', 6698718.6, 130, 6, 3, 1, 240, 3, 2, 12, '2017-09-07 00:00:00', '2018-03-14 00:00:00', '2018-11-12 00:00:00', 'Edificio Nuevo - 170 metros cuadrados ue incluyen SUM, oficina, office, parrilla cubierta, sanitarios ambos sexos y discapacitados y patio de expansión. El cálculo estructural contemplará una futura ampliación en Planta Alta.', '13 00 01 79', 21, 0, 30, '2018-12-10 00:00:00', 0, 60, '2019-02-09 00:00:00', 60, '2019-04-10 00:00:00', 6, 'Resol. N° 526/18', 'Resol. N° 706/18', 'Disp. N° 86/19', NULL, NULL, '(*) Varios Expte. N° 140-1621/18 de $142306,6 y Expte. N° 140-1622/18 de $ 393,239,73 y Expte. N° 140-2473/18 de $ 129,409,85 y Expte. N° 140-2474/18 de $ 213,087,64 y Expte. N° 140-3256/18 de $ 419,682,34 y Expte. N° 140-1383/18 de $ 404591,95 y Expte. N° 140-1384/18 de $ 159,195,69 y Expte. N° 140-1174/19 de $ 45,772,89 y Expte. N° 140-1052/19 de $ 71,839,08', 0, NULL, 404591.95, 159195.69, 1979125.77, 'Expte. N° 140-1383/18', 'Expte. N° 140-1384/18', '* Varios', 1, 2017, '140-003125/15', 0, 'may-17', 0, 12, 1169, 6730351.25, 0, '2017-07-20 00:00:00', 'DO', '2017-07-10 00:00:00', NULL, 'Disp. N° 184/19', NULL, '2019-09-02 00:00:00', NULL, 0, 0, NULL, 0, NULL);
INSERT INTO `obras` VALUES (896, 'Iglesia Nuestra Señora de Itati - Ampliacion y Refaccion', 'Resol. N° 569/18', 10253373.99, 2, 25, 3, 1, 360, 2, 21, 2, '2018-12-14 00:00:00', '2019-03-15 00:00:00', '2020-03-09 00:00:00', 'Se refaccionarán 185 metros cuadrados en los sectores de la casa del párroco y la nave central de la iglesia ejecutando demolición de piso de la nave central para aumentar la altura del nivel interior con recambio total de solado. Se realizarán tareas sobre los revoques laterales de toda la nave central para solucionar problemas de humedad. Se realizara pintura completa interior / exterior tanto de la nave central como de la casa del párroco, y recambio de artefactos de iluminación. Se colocarán nuevas carpinterías y se reconstruirá a nuevo la vereda perimetral.\r\nSe ampliarán 300 metros cuadrados construyendo una nueva sacristía, oficina administrativa, un aula grande, dos aulas medianas y una Sala de Usos Múltiples. Además, se construirá un nuevo núcleo sanitario ampliado para hombres y para mujeres y dos depósitos. En la zona anexa al SUM se construirá una cocina y un quincho semicubierto. Completan el proyecto la construcción de una sala de bombeo, una galería perimetral y un patio claustral descubierto', '11 00 02 77', 13, 668612.19, 39, '2020-09-13 00:00:00', 0, 0, NULL, 0, NULL, 28, 'Resol N° 488/20', NULL, NULL, 'Resol N° 488/20', NULL, NULL, 0, NULL, 2017484.82, 716040.01, 859574.62, NULL, NULL, NULL, 1, 2019, NULL, 1, 'jun-18', 0, 12, 1052, 10432656.11, 0, '2018-11-06 00:00:00', 'DEyP', '2018-09-10 00:00:00', '2017-10-05 00:00:00', NULL, NULL, NULL, NULL, 0, 0, NULL, 0, NULL);
