INSERT INTO `obras` VALUES (930, 'Hospital "San Vicente de Paul" - Refaccion y Ampliacion 2', 'Resol. N° 783/18', 21558855.81, 75, 1, 3, 1, 240, 2, 3, 6, '2019-01-29 00:00:00', '2019-02-12 00:00:00', '2019-10-10 00:00:00', '	Recuperación completa del edificio antiguo funcional y tecnológicamente. \r\nIncluye refaccion de muros, pisos, zócalos, revestimiento, recuperación y completamiento de revoques, pintura interior y exterior, instalaciones eléctricas y sanitaria, carpinterías de aluminio color, cielorrasos de placa de yeso y PVC a tablillas, repaso de cubiertas y ejecución a nuevo del sector oeste sobre medianera. Desde el punto de vista funcional, se mejoraran los espacios de Administración y control de acceso pacientes, laboratorio, kinesiología, consultorio médico clínico y odontológico, Vacunatorio, farmacia, lavadero, sumarios y jefatura de enfermería, facturación y SUM. Respecto las galerías-circulaciones se demolerán las columnas para dotarlas por otras de mayor seguridad. Se demolerá Rx con su espera a efectos de ubicarlas en lugar donde su funcionamiento mejore y relacionarlo directamente con el nuevo proyecto de Emergencia, internación, quirófano y ARN.\r\n	Se construirán sanitarios con boxes para damas, caballeros y discapacitados y sector de  Emergencias, la que contrá con espera, control de accesos y pacientes, consultorio, sanitarios, enfermería shockroom, hemoteca, y dormitorio médicos de guardia con su respectivo sanitario.', '13 00 02 66', 6, 4202223.22, 60, '2019-12-09 00:00:00', 0, 74, '2020-02-24 00:00:00', 0, NULL, 1, 'Resol. N° 753/19', 'Resol N° 872/19', NULL, 'Resol N° 872/19', NULL, NULL, 0, NULL, 4511786.6, 1023842.58, 978302.89, 'Expte. N° 140-0168/19', NULL, NULL, 1, 2019, '140-002370/18', 0, 'jun-18', 0, 12, 14, 22043819.85, 0, '2018-12-13 00:00:00', 'DO', '2018-11-30 00:00:00', '2018-09-03 00:00:00', 'Disp. N° 293/20', NULL, '2020-09-29 00:00:00', NULL, 0, 0, NULL, 0, NULL);
