INSERT INTO `obras` VALUES (945, 'Hospital "Jose R. Vidal" - Cubierta-Techos - Construccion y Refaccion', 'Resol. N° 22/19', 9182010.72, 121, 25, 3, 1, 180, 2, 4, 6, '2019-05-23 00:00:00', '2019-06-07 00:00:00', '2019-12-04 00:00:00', 'Reparación de filtraciones en Losas, y tratamiento de desagües pluviales con descargas mediante embudos y bajadas redireccionadas.\r\nCambio de cubierta de chapa y estructura soporte en almacén, redireccionando pendientes y pluviales.\r\nLimpieza, desobstrucción y reparación de cámaras cloacales y pluviales, en los sectores que presentan desbordes; y construcción de otras nuevas.\r\nReconstrucción de cielorrasos en sectores deteriorados', '11 00 02 68', 1, 0, 0, NULL, 0, 0, NULL, 0, NULL, 38, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 2275428.034, 0, 0, NULL, NULL, NULL, 1, 2019, NULL, 1, 'sep-18', 0, 10, 11, 9466135.71, 0, '2019-03-26 00:00:00', 'DO', '2019-02-27 00:00:00', '2018-12-07 00:00:00', NULL, NULL, NULL, NULL, 0, 0, NULL, 0, NULL);
INSERT INTO `obras` VALUES (946, 'Hogar de Ancianos de Ituzaingó - Obra Nueva', 'Resol. N° 24/19', 26831300.04, 8, 5, 3, 1, 420, 2, 15, 12, '2022-07-06 00:00:00', '2019-07-15 00:00:00', '2020-09-07 00:00:00', 'Demolicion de lo existente y construccion de nuevo edificio. 900m2 (12 habitaciones, area administrativa y servicios)\r\n------------------------------\r\nSe construirá una sede totalmente a nuevo\r\nSe demolerá la totalidad de lo existente y se construirán a nuevo 900 m2 que contendrán\r\n12 habitaciones con 1 sanitario para discapacitados cada 2 habitaciones, además de una habitación para personal de guardia.\r\n          Al frente se ubicará una oficina administrativa con sanitario, office y depósito. El programa se completa con un sector de cocina - comedor para personal y depósito de alimentos y en general; un quincho semicubierto y un comedor diario.\r\n           También se construirá una torre-tanque de reserva y se prevee un ingreso vehicular sobre la fachada sobre calle Entre Ríos', '13 00 02 90', 8, 5366260.01, 120, '2021-01-04 00:00:00', 0, 135, '2021-03-31 00:00:00', 420, '2022-02-27 00:00:00', 5, 'Resol N° 650/20', 'Resol N° 809/20', 'Resol N° 349/21', 'Resol N° 809/20', NULL, 'Redet. Adic 1 140-002859/20 $4826644,61 sep-20\r\nobra basica 140-003089/20 $194737,61 sep-20\r\nobra basica  140-002858/20 $\r\n\r\nResol. N° 1246/21 Rescision de CONTRATO (EN RECEPCION DEFINITIVA)', 0, NULL, 4978896.53, 2410779.8, 1129988.4, NULL, NULL, NULL, 1, 2019, NULL, 1, 'sep-18', 0, 10, 1404, 27388283.36, 0, '2019-03-26 00:00:00', 'DEyP', '2019-02-20 00:00:00', '2018-12-10 00:00:00', NULL, 'Resol. N° 1246/21', NULL, '2021-10-27 00:00:00', 0, 0, NULL, 0, NULL);
INSERT INTO `obras` VALUES (947, 'Residencia Oficial N° 10 - Refaccion y Ampliacion', 'Disp. N° 12/19', 3496836.32, 114, 37, 3, 1, 180, 1, 4, 9, '2019-01-25 00:00:00', '2019-02-04 00:00:00', '2019-08-03 00:00:00', 'Tareas de mantenimiento y conservación incluyendo Refacción parcial de cubierta de tejas, aislación y estructura para techo de madera, Demolición parcial y reemplazo de cielorraso aplicado a la cal; Reemplazo de aberturas en planta alta con provisión y colocación de carpinterías DVH línea Módena- vidrio doble; Provisión y ejecución a Nuevo de Tablero Eléctrico, re cableado y artefactos de iluminación en vivienda y quincho; Reubicación de Tanque Cisterna y provisión sistema eléctrico de Bombeo; Desplazamiento y redimensionado de cerco perimetral de madera; Retiro y reconstrucción de piso exterior; Ejecución a nuevo de Deposito de Servicio; Construcción de Casilla de Gas y Casilla para Tablero Eléctrico, adosadas al Depósito; Pintura integral interior - exterior de la Residencia.', '13 00 01 56', 1, 0, 0, NULL, 0, 0, NULL, 0, NULL, 24, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 171207.77, 30301.97, NULL, '140-0799/19', '140-001164/19', NULL, 1, 2019, '140-003520/18', 1, 'sep-18', 0, 12, NULL, 3496836.32, 0, NULL, 'DEyP', '2019-01-22 00:00:00', '2018-12-11 00:00:00', NULL, NULL, NULL, NULL, 0, 0, NULL, 0, NULL);
INSERT INTO `obras` VALUES (948, 'Escuela Arandu Roga (EFA) - Refaccion y Terminacion SUM', 'Disp. N° 66/19', 3217195.73, 146, 26, 3, 1, 180, 1, 32, 3, '2019-04-10 00:00:00', '2019-05-01 00:00:00', '2019-10-28 00:00:00', 'Refaccion de 215 metros cuadrados incluidos terminación exterior e interior de SUM e interior de Cocina y Despensa (zinguerias, revoques, carpinterías, veredas perimetrales, pintura gral, instalacion electrica y sanitaria, pisos y cielorrasos, terminación de cocina completa)', '13 00 03 76', 16, 0, 60, '2019-12-27 00:00:00', 0, 0, NULL, 0, NULL, 13, 'Resol. N° 801/19', NULL, NULL, NULL, NULL, NULL, 0, NULL, 711792.55, 212955.06, 81678.51, 'Expte N° 140-1583/19', 'Expte N° 140-2039/19', 'Expte N° 140-002517/19', 1, 2019, '140-003602/18', 0, 'ago-18', 0, 10, 1419, 3217195.73, 0, '2019-04-04 00:00:00', 'DEyP', NULL, '2018-12-18 00:00:00', NULL, NULL, NULL, NULL, 0, 0, NULL, 0, NULL);
INSERT INTO `obras` VALUES (949, 'Iglesia "Santa Rosa" - Refaccion', 'Disp. N° 253/19', 9710991.16, 13, 44, 3, 1, 240, 3, 39, 2, '2019-12-12 00:00:00', '2020-02-12 00:00:00', '2020-10-09 00:00:00', 'Refaccion Integral: cambio del 30 % de la cubierta - Colocación de pisos en nave y sacristía - construcción de ubaño para sacristía - Refacción del 30% de cirlorrasos - Construcción de entrepiso metálico en campanarios - Construcción de casilla de cisterna - Reparación de carpinterías - Pintura total del edificio.', '11 00 02 95', 25, 1764883.58, 30, '2020-12-08 00:00:00', 0, 240, NULL, 0, NULL, 10, 'Nota N° 202/20', 'Nota N° 262/20', NULL, 'Nota N° 262/20', NULL, NULL, 0, NULL, 863684.12, 493439.01, 1026723.82, NULL, NULL, NULL, 1, 2019, NULL, 1, 'sep-19', 0, 10, 1434, 9969631.94, 0, '2019-11-12 00:00:00', 'DC', '2019-10-18 00:00:00', '2018-12-18 00:00:00', NULL, NULL, NULL, NULL, 0, 0, NULL, 0, NULL);
INSERT INTO `obras` VALUES (950, 'Hospital "Fernando I. Valenzuela" - Refaccion y Ampliacion', 'Resol N° 100/19', 15682869.2, 21, 27, 3, 1, 540, 2, 71, 6, '2019-11-08 00:00:00', '2019-12-16 00:00:00', '2021-06-08 00:00:00', 'Se refaccionarán 640 metros cuadrados y se ampiarán otros 45; contemplando la reorganización funcional de las áreas de administración, nuevo núcleo sanitarios para discapacitados en la zona publica de consultorios externos, generación de un consultorio de ginecología con sanitario y cardiología con gabinete de examen físico y electrocardiograma. Además, se refuncionalizará el sector de emergencias. En la misma zona y en área semirrestringida, se organizará el área de partos con un sector de Atención para recién nacidos y baño exclusivo, en contacto con el área de hemotéca, enfermería, emergencias e internación.\r\nSe reorganizará todo el sector de servicios, que queda conformado por un Salón de Usos Múltiples para personal y capacitación, un sector de baños y vestuarios de personal para ambos sexos, un área de lavandería nueva y cocina refuncionalizada.\r\nEn el exterior, se provee un depósito de cadáveres y una pequeña sala velatoria.', '13 00 02 89', 3, 0, 60, '2021-08-07 00:00:00', 0, 60, '2021-10-06 00:00:00', 150, '2022-03-05 00:00:00', 13, 'Resol N° 185/20', 'Resol N° 1066/21', 'Resol Nº 44/21', NULL, NULL, NULL, 0, NULL, 5463151.49, 1385044.08, 816597.31, NULL, NULL, NULL, 1, 2019, NULL, 0, 'sep-18', 0, 10, 839, 16002927.75, 0, '2019-10-03 00:00:00', 'DEyP', '2019-09-23 00:00:00', '2018-12-17 00:00:00', 'Disp. N° 415/22', NULL, '2022-10-28 00:00:00', NULL, 0, 0, NULL, 0, NULL);
INSERT INTO `obras` VALUES (951, 'Hogar de Ancianos "Gregoria M. de San Martín" - Refaccion y Ampliacion', 'Resol. N° 349/20', 32795000, 92, 26, 3, 1, 360, 2, 24, 12, '2020-09-18 00:00:00', '2020-10-05 00:00:00', '2021-09-29 00:00:00', 'Refaccion general de 600 m2 y ampliacion de 85 m2. Reconstrucción de cubierta, Refuncionalizacion de locales y refaccion de revoques, pisos e instalaciones\r\n----------------------\r\nSe propone realizar una refacción y ampliación de todo el edificio.\r\nSe reconstruirá a nuevo la cubierta. Asi como la instalación de agua fría y caliente, instalación eléctrica, y desagües cloacales de los sectores a intervenir.\r\nSe reconstruiran los revoques en algunos sectores; y los cielorrasos y pisos serán reemplazados en su totalidad.\r\nEn cada dormitorio se construirá un baño privado y serán reemplazados los frentes de placard. junto con el resto de las carpinterías\r\nEl comedor, la cocina, lavadero y depósito serán reubicados y se construirá un Quincho con Parrilla sobre el patio delantero.\r\nSe construirá una torre tanque en el patio de servicio \r\nLa vereda municipal y perimetral será demolida para luego reconstruirla. Por último se procederá al pintado de la totalidad del Establecimiento, totalizando 85 metros cuadrados de ampliación y 600 metros de refaccion', '11 00 02 60', 12, 3080657.8, 51, '2021-11-19 00:00:00', 3478342.2, 60, '2021-11-29 00:00:00', 57, '2022-01-31 00:00:00', 54, 'Resol N° 674/21', 'Resol N° 660/21', 'Resol N° 321/22', 'Resol N° 674/21', 'Resol N° 321/22', NULL, 0, NULL, 7918074.66, 4051128.48, 481558.51, NULL, NULL, NULL, 1, 2019, NULL, 1, 'dic-19', 0, 10, 1407, 33003700.61, 0, '2020-08-04 00:00:00', 'DC', '2019-02-27 00:00:00', '2018-12-18 00:00:00', 'Disp. N° 310/21', NULL, '2021-10-12 00:00:00', NULL, 0, 0, NULL, 0, NULL);
INSERT INTO `obras` VALUES (952, 'Direccion de Transporte Fluvial y Puertos - Refaccion', 'Disp. N° 66/20', 5033850.58, 77, 45, 3, 1, 150, 1, 4, 7, '2019-03-13 00:00:00', '2020-05-04 00:00:00', '2020-10-30 00:00:00', 'Se refaccionarán 460 metros cuadrados del edificio situado sobre la Avenida Juan Torres de Vera y Aragón al 1000. Se pretende solucionar problemas de fisuras, desprendimiento de revoques afectados por la humedad y descascaramiento de la pintura. Asentamiento de las veredas perimetrales exteriores. Fisuras en paramentos interiores, humedad en cielorrasos, además del deterioro y oxidación de caños, bocas y cajas de tomas de la instalación eléctrica. Deformaciones en mamparas de aluminio de las oficinas. Finalizando con pintura general del edificio tanto en el exterior como en el interior.', '11 00 02 51', 1, 975137.5, 46, '2021-01-28 00:00:00', 0, 80, '2020-12-20 00:00:00', 0, NULL, 44, 'Resol N° 946/20', 'Resol.  N° 179/21', NULL, 'Resol. N° 946/20', NULL, NULL, 0, NULL, 565089.71, 141663.76, 403833.97, NULL, NULL, NULL, 1, 2019, NULL, 0, 'dic-19', 0, 10, 27, 5033850.58, 0, '2020-03-09 00:00:00', 'DEyP', '2020-03-10 00:00:00', '2018-12-20 00:00:00', 'Disp. N° 182/21', 'Disp. N° 3/22', '2021-05-10 00:00:00', '2021-12-27 00:00:00', 0, 0, NULL, 0, NULL);
