INSERT INTO `obras` VALUES (955, 'Hospital Cabecera "San Jose" - Reparacion y Mantenimiento', 'Disp. N° 115/20', 8017203.47, 49, 26, 3, 1, 150, 1, 24, 6, '2020-08-04 00:00:00', '2020-10-01 00:00:00', '2021-02-27 00:00:00', 'Se solucionarán problemas de filtraciones sobre las cubiertas planas (losas), realizando sobre las mismas trabajos de impermeabilizacion, tambien se encaran trabajos de limpieza y desobstruccion de canaletas y bajadas de pluviales, complementandose las mismas con desobstruccion de conductales y bocas que corren sobre veredas. Además, se trabajará sobre problemas de filtarciones en carpinterias que dan al exterior, revision y mantenimiento de pasillos tecnicos y sanitarios y pintura interior en locales intervenidos.', '11 00 01 51', 12, 0, 0, NULL, 0, 0, NULL, 0, NULL, 39, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 1388645.73, 151245.33, 436103.96, NULL, NULL, NULL, 1, 2019, NULL, 1, 'dic-19', 0, 10, 681, 8017203.47, 0, '2020-06-08 00:00:00', 'DEyP', '2020-04-21 00:00:00', '2020-03-12 00:00:00', 'Disp. N° 181/21', 'Disp. N° 345/21', '2021-05-15 00:00:00', '2021-11-24 00:00:00', 0, 0, NULL, 0, NULL);
INSERT INTO `obras` VALUES (956, 'Puerto de Corrientes - Refaccion de Intalaciones de Alumbrado', 'Disp. N° 70/19', 1199000.45, 29, 40, 3, 1, 90, 1, 4, 7, '2019-04-24 00:00:00', '2019-05-15 00:00:00', '2019-08-13 00:00:00', 'Las obras consisten en la refaccion completa y puesta en funcionamiento de las cajas de toma eléctricas para embarcaciones, situadas en el muelle. Reemplazo de las luminarias actuales de la playa de maniobras por reflectores del tipo LED; y refaccion total de las instalaciones de iluminación de circulación y seguridad', '13 00 01 98', 1, 0, 0, NULL, 0, 0, NULL, 0, NULL, 26, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 52311.93, 55944.77, 0, '140-001962/19', '140-001108/19', NULL, 1, 2019, '140-001085/18', 1, 'ene-19', 0, 10, 84, 1199000.45, 0, '2019-04-08 00:00:00', 'DEyP', '2019-04-09 00:00:00', '2018-12-19 00:00:00', 'Disp. N° 255/19', 'Disp. N° 146/20', '2019-09-13 00:00:00', '2020-03-16 00:00:00', 0, 0, NULL, 0, NULL);
INSERT INTO `obras` VALUES (957, 'Escuela Primaria Comun N° 533 "San Jose" - Refaccion y Ampliacion', 'Disp. N° 277/19', 6824643.18, 122, 44, 3, 1, 210, 3, 26, 3, '2019-06-03 00:00:00', '2019-06-18 00:00:00', '2020-01-13 00:00:00', 'Los trabajos incluyen la refaccion general del edificio. Interviniendo la instalación eléctrica y los desagues cloacales, ambos en mal estado; realizando a nuevo ambos sistemas además de las instalaciones de agua fría y caliente. Los sanitarios para alumnos serán demolidos, construyendo nuevos diferenciados por sexos y uno para discapacitados.\r\nSe repararán revoques en mal estado y los cielorrasos serán cambiados en su totalidad\r\nSe refaccionará la cocina y el sector de parrillas. Todas las carpinterpias serán restauradas.\r\nLa vereda perimetral será reconstruida a nuevo junto con un patio de formación.\r\nSerán restaurados los juegos infantiles y el mástil. Se procederá a pintar la totalidad del edificio\r\nAdemás, se construirá una ampliación de 120 m2 consistente en 2 (dos) aulas, un sector administrativo para oficina de Dirección y una Secretaria/Biblioteca; y se ampliará la galería existente acompañando la nueva construcción.', '13 00 03 77', 24, 1170549.5, 49, '2020-03-02 00:00:00', 0, 100, '2020-06-01 00:00:00', 0, NULL, 54, 'nada toque sin quereResol. N° 798/19', 'Resol. N° 418/20', NULL, 'Resol. N° 798/19', NULL, NULL, 0, NULL, 2680777.39, 624564.67, 751096.71, NULL, NULL, NULL, 1, 2019, NULL, 1, 'jul-18', 0, 10, 1411, 7017037.99, 0, '2019-04-25 00:00:00', 'DC', '2019-02-27 00:00:00', '2018-10-16 00:00:00', NULL, NULL, NULL, NULL, 0, 0, NULL, 0, NULL);
INSERT INTO `obras` VALUES (958, 'C.D.I Mama Margarita - Refaccion y Refuncionalización - Patio y Salas', 'Disp. N° 37/20', 7838503.06, 141, 31, 3, 1, 240, 1, 4, 12, '2020-04-13 00:00:00', '2020-06-01 00:00:00', '2021-01-26 00:00:00', 'Refacción Integral y refuncionalización de Patio de Formación y Salas de Jardín de Infantes. Se construirá nuevo piso en el patio de formación y una galería como conexión con el edificio escolar.\r\nEn las Salas Jardín, galería y sanitarios, se realizarán una refuncionalización y refacción integral (reposición techos de chapas, colocación de pisos y cielorrasos, reparacion de revoques y carpinterías, colocacion de aberturas nuevas. Construccioón de mesada, instalación eléctrica a nuevo y pintura general)', '11 00 01 56', 1, 1236633.07, 60, '2021-03-29 00:00:00', 0, 54, '2021-05-22 00:00:00', 0, NULL, 45, 'Resol. N° 180/21', 'Nota N° 73/21', NULL, 'Nota N° 73/21', NULL, 'expediente antiguo 953-004561/18', 0, NULL, 1301310.04, 358899.8, 0, NULL, NULL, NULL, 1, 2019, NULL, 0, 'oct-19', 0, 10, 1186, 7838503.06, 0, '2020-02-12 00:00:00', 'DC', '2020-01-31 00:00:00', '2020-01-03 00:00:00', 'Disp. N° 305/21', 'Disp. Nº 249/22', '2021-10-07 00:00:00', '2022-06-15 00:00:00', 0, 0, NULL, 0, NULL);
