INSERT INTO `obras` VALUES (960, 'Polideportivo Municipal - Obra Nueva', 'Resol. N° 177/20', 36298706.26, 27, 26, 3, 1, 480, 2, 18, 12, '2020-08-05 00:00:00', '2020-09-01 00:00:00', '2021-12-24 00:00:00', 'Construccion de gimnasio para deportes y actividades sociales. propiedad del Municipio. En etapa de relevamiento. Se propone un edificio de 1260 m2, con cancha para basquet y volley ball, tribunas, sanitarios, vestuarios, cocina.', '11 00 02 52', 13, 0, 0, NULL, 0, 0, NULL, 0, NULL, 10, NULL, NULL, NULL, NULL, NULL, 'Arq. Noelia Rodriguez', 0, NULL, 6605230.27, 982877.01, 3903576.08, NULL, NULL, NULL, 1, 2019, NULL, 0, 'dic-19', 0, 10, 1371, 37062504.26, 0, '2020-06-23 00:00:00', 'DC', '2020-03-16 00:00:00', '2020-02-21 00:00:00', 'Disp, N° 98/22', NULL, '2022-05-26 00:00:00', NULL, 0, 0, NULL, 0, NULL);
