INSERT INTO `obras` VALUES (971, 'Centro de Ex Combatientes en Malvinas - Ref y Amp Consultorios Externo', 'Disp. N° 188/20', 5498101.83, 77, 45, 3, 1, 120, 1, 4, 12, '2020-07-27 00:00:00', '2020-08-24 00:00:00', '2020-12-21 00:00:00', 'El proyecto consiste en la refacción  integral del  edificio y ampliación del sector de kinesiología  que complementara el existente dando respuesta a la demanda actual y proyectada.\r\nSe procederá a refaccionar la fachada del edificio. Se agregará un ascensor con la respectiva sala de maquinas  para mejorar la accesibilidad a la Planta Alta. Se realizará la limpieza del tanque de reserva existente, remplazándose los caños de bajada, se colocarán nuevas carpinterías de cerramiento en el patio y conector de la Planta Alta. Se proveerá y colocará una plataforma para mejorar las instalaciones de los Split ubicados en la fachada, procediendose al recambio de las mesadas con bachas y muebles fijos del salón de reuniones y enfermería.\r\nTambién se harán reparaciones de revoques, molduras deterioradas y pintura general de todo el edificio.', '11 00 02 79', 1, 1099620.37, 120, '2021-04-20 00:00:00', 0, 40, '2021-08-21 00:00:00', 0, NULL, 52, 'Resol N° 273/21', 'Resol N° 790/21', NULL, 'Resol N° 273/21', NULL, NULL, 0, NULL, 979310.15, 156530.47, 368241.66, NULL, NULL, NULL, 1, 2019, 'Memo 46/18', 0, 'Dic-19', 0, 10, 1266, 5498101.83, 0, '2020-07-14 00:00:00', 'DEyP', '2020-07-14 00:00:00', '2019-05-02 00:00:00', 'Disp. N° 251/21', NULL, '2021-08-23 00:00:00', NULL, 0, 0, NULL, 0, NULL);
