INSERT INTO `obras` VALUES (991, 'Asociacion Goyana de Atletismo (AGDA) - Refaccion y Ampliacion', 'n', 28319858.97, 132, 24, 3, 11, 360, 2, 11, 12, NULL, NULL, NULL, 'Sobre nueva estructura de H° A °  se desarrollarán un albergue deportivo y un gimnasio, con comedor, cocina, lavadero y dos dormitorios múltiples, incluyendo sanitarios para ambos sexos y discapacitados. En Planta baja, se refaccionará a nuevo el actual gimnasio para convertirlo en SUM, incluyendo los sanitarios. Se intervendrá la fachada refaccionando el acceso y adecuandolo al uso de personas con movilidad reducida, y agregando además cartelería identificatoria. Se proveerá TR incluída su estructura portante y bomba de impulsion. En todos los sectores intervenidos se realizará a nuevo la Instalación eléctrica y pintura completa.', '13 00 00 00', 18, 0, 0, NULL, 0, 0, NULL, 0, NULL, 28, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 0, 0, 0, NULL, NULL, NULL, 1, 2020, NULL, 0, 'jun-20', 0, 13, 920, 28319858.97, 0, NULL, 'DEyP', NULL, '2020-09-17 00:00:00', NULL, NULL, NULL, NULL, 0, 0, NULL, 0, NULL);
