INSERT INTO `obras` VALUES (994, 'CPM Nº 19 "San Luisito" - CDI San Luis del Palmar - Obra Nueva', 'Resol. N° 825/22', 102920008.98, 33, 30, 3, 1, 420, 2, 71, 12, '2022-07-25 00:00:00', '2022-08-01 00:00:00', '2023-09-25 00:00:00', 'Se demolerá totalmente el edificio existente y se construirán 748 metros cuadrados conteniendo ambos centros, los que se desarrollan en dos alas. En una el CDI, con cinco salas (cada una con su sanitario), SUM, patio de juegos, cocina, deposito de alimentos y sanitarios. El CPM despliega dos aulas, comedor, cocina, depósitos y sanitarios. Ambos centros comparten sectores administrativos.', '13 00 01 54', 3, 0, 0, NULL, 0, 0, NULL, 0, NULL, 55, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 4333149.58, 4657800, 2749383.02, NULL, NULL, NULL, 1, 2020, NULL, 0, 'Feb-22', 0, 10, 1448, 104924058.5, 0, '2022-06-30 00:00:00', 'DEyP', '2022-06-16 00:00:00', '2022-03-22 00:00:00', 'Disp. N° 7/24', NULL, '2023-12-18 00:00:00', NULL, 0, 0, NULL, 0, NULL);
