INSERT INTO `obras` VALUES (996, 'Catedral "Inmaculada Concepción" - Refaccion y Puesta en Valor', 'Disp. N° 278/20', 12919295.95, 72, 48, 3, 1, 240, 3, 33, 2, '2020-11-30 00:00:00', '2021-01-04 00:00:00', '2021-08-31 00:00:00', 'El proyecto consiste en la refacción y puesta en valor de la Iglesia Catedral de Santo Tomé. Repazo y mantenimiento de la cubierta de chapa existente, remplazandose si es necesario las canaletas y desagües existentes, recuperación de los revoques y cielorrasos afectados por las humedades producidas por filtraciones y eflorescenciás. Revoque completo exterior, sobre el ladrillo a la vista existente y restauración de la fachada principal.', '11 00 02 57', 9, 2583859.19, 30, '2022-05-07 00:00:00', 0, 0, NULL, 0, NULL, 53, 'Resol N° 322/22', NULL, NULL, 'Resol N° 322/22', NULL, NULL, 0, NULL, 2344829.6, 243087.53, 405763.48, NULL, NULL, NULL, 1, 2020, 'Mermo 32/19', 0, 'Abr-20', 0, 10, 412, 13113085.39, 0, '2020-10-01 00:00:00', 'DEyP', '2020-08-24 00:00:00', '2020-07-31 00:00:00', 'Disp. N° 332/21', NULL, '2021-11-24 00:00:00', NULL, 0, 0, NULL, 0, NULL);
