INSERT INTO `obras` VALUES (1001, 'Hospital San Miguel - Refaccion 3a Etapa', 'Disp. N° 82/20', 11614592.98, 21, 27, 3, 1, 180, 3, 29, 6, '2020-07-29 00:00:00', '2020-08-18 00:00:00', '2021-02-13 00:00:00', 'Refaccion de sector de residencia médica, adaptándolo para su uso como consultorios externos. Además se refaccionaran la vivianda lindante y las cocheras de ambulancias y accesos. Este sector será ampliado con una habitacion y un sanitario para choferes y dos locales para depósito. Además se cambiarán las chapas y cielorrasos de la galería existente', '13 00 02 54', 7, 2117412.54, 60, '2021-04-16 00:00:00', 0, 60, '2021-06-15 00:00:00', 90, '2021-09-13 00:00:00', 13, 'Resol. N° 178/21', 'Resol N° 540/21', 'Resol N° 540/21', 'Resol. N° 490/22', NULL, NULL, 0, NULL, 2110306.41, 412304.36, 1184365.59, NULL, NULL, NULL, 1, 2020, '587/19', 0, 'DIC-19', 0, 10, 1141, 11986777.22, 0, '2020-05-07 00:00:00', 'DEyP', '2020-04-21 00:00:00', '2020-03-12 00:00:00', 'Disp. N° 42/22', NULL, '2022-03-28 00:00:00', NULL, 0, 0, NULL, 0, NULL);
