INSERT INTO `obras` VALUES (1003, 'Museo Historico de la Provincia "Tte. de Gdor. Manuel Cabral de Melo y', 'Disp. N° 276/22', 20585542.72, 91, 25, 3, 1, 360, 3, 4, 3, '2022-12-29 00:00:00', '2023-02-15 00:00:00', '2024-02-10 00:00:00', 'Intervencion para solucionar problemas puntuales. Humedades y filtraciones en mampostería, filtraciones en cubierta de tejas y otros.\r\nEn salas 1 y 2 se ejecutará nuevo cielorraso de entablonado de madera, reparacion de revoques y pintura de carpinterías zocalos de madera y herrerías\r\nSe reemplazará la cubierta del salón de música y depositos, incluyendo desagues pluviales y reemplazo de cielorrasos, aislacioones, y estructuras afectados por la humedad. En techos de tejas se reemplzarán las canaletas y bajadas pluviales. Por ultimo se intervendrá en la fachada del museo culminando con pintura general de los sectores intervenidos.', '13 00 01 58', 1, 0, 90, '2024-05-11 00:00:00', 0, 60, '2024-07-10 00:00:00', 0, NULL, 45, 'Resol.N° 466/24', 'Resol. Nº 1092/24', NULL, NULL, NULL, NULL, 0, NULL, 10757116.7, 2693885.77, 3988166.96, NULL, NULL, NULL, 1, 2020, NULL, 0, 'May-22', 0, 10, 1401, 20729641.58, 1, '2022-10-20 00:00:00', 'DEyP', '2021-11-17 00:00:00', '2022-06-06 00:00:00', NULL, NULL, NULL, NULL, 0, 0, NULL, 0, NULL);
INSERT INTO `obras` VALUES (1004, 'Plaza Central y Tanques de Agua – Refacción Reparacion', 'Disp. N° 270/19', 3994376.19, 96, 35, 3, 1, 90, 1, 70, 12, '2019-12-06 00:00:00', '2019-12-16 00:00:00', '2020-03-14 00:00:00', 'Acondicionamiento, repaso de instalación eléctrica de soportes y aisladores de la descarga a tierra del pararrayos, puesta a tierra, baliza, bomba sumergible, cañería de alimentación y bajada. Tratamiento anticorrosivo y pintura con doble capa de esmalte sintético; en TT cilíndrico\r\nReparación, cañerías de impulsión y bajadas reemplazo de bomba sumergible. Repaso de instalación eléctrica, tableros, soportes y aisladores de la descarga a tierra del pararrayos, puesta a tierra, baliza, tratamiento anticorrosivo y pintura con doble capa de esmalte sintético; en TT Reticulado.\r\nRestaurar empalme de ambos tanques a red de suministro.\r\nColocar puertas, instalación eléctrica, tableros eléctricos a nuevo, tejido perimetral, columnas de poste olímpico, portón de acceso a nuevo, murete de mampostería de ladrillos comunes enrasada. Pintura látex exterior – interior, de cielorraso, esmalte sintético y aislación hidráulica, en Casilla de Comandos\r\nPLAZA CENTRAL\r\nReparación de hamacas, pintura, juegos y equipamiento. Reparacion de rejas y portones, pisos y veredas perimetrales.', '11 00 02 55', 3, 0, 0, NULL, 0, 0, NULL, 0, NULL, 13, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 0, 0, 0, NULL, NULL, NULL, 1, 2020, NULL, 1, 'sep-19', 0, 10, 1438, 3994376.19, 0, '2019-11-13 00:00:00', 'DEyP', '2019-11-13 00:00:00', '2019-10-30 00:00:00', 'Disp. N° 300/21', NULL, '2021-10-18 00:00:00', NULL, 0, 0, NULL, 0, NULL);
