INSERT INTO `obras` VALUES (1012, 'Parque Industrial y Puerto de ITU - Cerco Perimetral y portal de Acces', 'Resol. N° 31/20', 31271401.81, 2, 43, 3, 15, 300, 2, 15, 7, '2020-06-19 00:00:00', '2020-07-06 00:00:00', '2021-05-01 00:00:00', 'El proyecto consiste en la construcción del cerco perimetral del predio, extensión aproximada de 3.100,00 metros lineales. Se construirá además un Pórtico de Acceso construido con perfilaría metálica y fundaciones de hormigón armado, revestido íntegramente con placas de aluminio compuesto; y una Casilla de Control con estructura de hormigón armado, con el fin de facilitar la interacción entre el encargado y los conductores de los transportes que ingresan y egresan del predio y veredas exteriores de cemento rodillado. En la playa de acceso se ejecutarán superficies enripiadas con tratamiento de suelo cemento y cordón cuneta. Se contemplan así mismo las instalaciones eléctricas, sanitarias y pluviales necesarias para el buen funcionamiento y seguridad del Parque Industrial.', '11 00 05 51', 8, 3918547.29, 120, '2021-09-01 00:00:00', 0, 30, '2021-10-01 00:00:00', 210, '2022-04-28 00:00:00', 34, 'Resol N° 309/21', 'Resol N° 664/21', 'Resol N° 309/21', 'Resol N° 664/21', NULL, NULL, 0, NULL, 8175266.69, 1316433.54, 1579464.14, NULL, NULL, NULL, 1, 2020, NULL, 0, 'sep-19', 0, 10, 1437, 32071343.3, 0, '2020-05-12 00:00:00', 'DEyP', '2020-02-10 00:00:00', '2019-10-10 00:00:00', 'Disp. N° 209/22', NULL, '2022-04-20 00:00:00', NULL, 0, 0, NULL, 0, NULL);
