INSERT INTO `obras` VALUES (1107, 'Iglesia "Nazareno de la Compañía de Jesús" - Refaccion', 'Disp. N° 247/22', 27250591.31, 33, 27, 3, 1, 180, 3, 4, 2, '2022-09-02 00:00:00', '2022-09-29 00:00:00', '2023-03-28 00:00:00', 'La obra de refacción contempla:\r\n La intervención en muros de capa aisladora con un sistema de  canalización y ventilación con rejillas. Sistema actual que permite el secado por circulación de aire en vez de la tradicional reconstrucción de capa aisladora.\r\nLa reconstrucción de piso y contrapiso de vereda perimetral y construcción de nuevo desagüe pluvial.\r\nEl repaso competo de cubierta incluyendo impermeabilización de sistema de desagüe pluvial, encuentro de cubierta con carga, reemplazo de clavos y tornillos y pintura total de cubierta.\r\nLa Reconstrucción de revoques exteriores desprendidos y reparación de grietas y fisuras. Por último, la Instalación eléctrica a nueva', '13 00 01 62', 1, 0, 0, NULL, 0, 0, NULL, 0, NULL, 50, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 3719042.63, 1237381.42, 1302779.29, NULL, NULL, NULL, 0, 2021, NULL, 0, 'Jun-22', 0, 10, 1056, 27643123.67, 0, '2022-08-04 00:00:00', 'DEyP', '2022-07-13 00:00:00', '2022-06-28 00:00:00', 'Disp. N° 253/23', NULL, '2023-06-10 00:00:00', NULL, 0, 0, NULL, 0, NULL);
