INSERT INTO `obras` VALUES (1127, 'Polideportivo "Virgen del Carmen" - Ampliacion y Refaccion', 'Resol. N° 1083/22', 48584708.39, 76, 44, 3, 15, 360, 2, 47, 12, '2022-10-27 00:00:00', '2022-12-19 00:00:00', '2023-12-14 00:00:00', 'Construccion de tribunas de H° A° en perimetro de cancha de basquetbol, con servicios en zona de bajo tribuna. Sobre calle Tucuman, se construirá el acceso con tratamineto de fachada y cerramiento completo del tinglado existente. También se refuncionalizará el área de baños y vestuarios; se adecuarán las galerias y se construirán rampas de acceso. Se repararán pisos de cemento, se reemplazarán cielorrasos, se adecuará la instalación sanitaria, se procederá al reemplazo de los artefactos de baños y cocina y se cambiarán puertas y carpinterías deterioradas por nuevas de aluminio con rejas y sistemas de seguridad. En zona de tribunas se reconstruirán pisos y se reparará a nuevo el piso de la cancha con un piso tipo industrial. SE culminará con pintura general en las zonas intervenidas', '13 00 01 62', 20, 0, 0, NULL, 0, 0, NULL, 0, NULL, 28, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 26484072.06, 10678606.23, 0, NULL, NULL, NULL, 0, 2022, NULL, 0, 'Mar-22', 0, 10, 1494, 48584708.39, 0, '2022-09-13 00:00:00', 'DEyP', '2022-08-01 00:00:00', '2022-05-24 00:00:00', NULL, NULL, NULL, NULL, 0, 0, NULL, 0, NULL);
