INSERT INTO `obras` VALUES (1236, 'Anfiteatro "Mario del Transito Cocomarola" - Obras de Mantenimiento', 'Resol. N°  226/23', 66035811.43, 33, 30, 3, 1, 180, 3, 4, 3, '2023-04-10 00:00:00', '2023-04-17 00:00:00', '2023-08-14 00:00:00', 'Esta Refaccion incluira los siguientes trabajos: \r\nNuevo acceso para camiones, mediante construcción de rampa de hormigón. Pintura en frente a escenario, fosa de escenario, columnas y pasillos laterales y Reemplazo de mesadas y artefactos en sanitarios de mujeres y hombres, en Sector de Escenario y Frente Escenario,\r\nEn Sector de Gradas, Reconstruccion de bancos de hormigón faltantes y en mal estado\r\nPintura general exterior e interior. Provisión de nuevos artefactos eléctricos y cerraduras y picaportes para puertas exteriores en camarines	\r\nEn sector CANTINAS; Reemplazo y pintura de placas de yeso en mal estado, exterior e interior. Provisión de cerraduras y picaportes faltantes para puertas. \r\nReemplazo a nuevo de revestimiento cerámico en cocina, y reemplazo de puerta de acceso por nueva puerta de chapa con su respectiva cerradura y picaporte.\r\nEn SECTOR SANITARIOS MIXTOS EXTERIOR, Reemplazo de griferías en mal estado. Verificación de todo el sistema sanitario (provisión de agua desde Tanques de Reserva y cañería cloacal). Pintura de paredes exteriores. Provisión y Colocación de señalética correspondiente.\r\nReemplazo de puerta de acceso por nueva puerta de chapa con su respectiva cerradura y picaporte y Reconstrucción de carga de mampostería en el sector que presenta fisuras. Pintura general con pintura impermeable sobre losa y esmalte sintético en carpinterías en sector boletería\r\nEn sector de torre tanque y tanques de bombeo y reserva, Readecuación de instalaciones sanitarias y eléctricas, incorporando casillas de mampostería y cierre perimetral metálico de protección.\r\nEn SECTOR OFICINAS DIRECTOR y ANEXOS; Reemplazo de puertas de chapas por puertas de aluminio, de mesadas con bachas en baños, también mingitorios en mal estado. Instalacion de ducha en sanitarios. La terminación de todo el sector será con pintura latex exterior-interior.\r\nEn sector ACCESOS; Reparacion de portón de acceso vehicular que se encuentra en mal estado. Reacondicionamiento en general en las instalaciones sanitarias y eléctricas de todo el predio (baños, camarines, torres tanques, cantinas, oficinas, escenario)', '13 00 01 52', 1, 0, 0, NULL, 0, 0, NULL, 0, NULL, 40, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 8802494.89, 892435.31, 0, NULL, NULL, NULL, 0, 2022, NULL, 0, 'Ene-23', 0, 10, 137, 67007419.01, 0, '2023-03-09 00:00:00', 'DIR', '2023-02-27 00:00:00', '2023-02-02 00:00:00', 'Disp. N° 257/23', NULL, '2023-06-06 00:00:00', NULL, 0, 0, NULL, 0, NULL);
INSERT INTO `obras` VALUES (1237, 'Cementerio de la Asociacion Israelita Latina de Corrientes - Refaccion', 'Disp. N° 57/23', 17227153.04, 162, 35, 3, 1, 180, 1, 4, 12, '2023-04-12 00:00:00', '2023-04-17 00:00:00', '2023-10-14 00:00:00', 'Las obras consisten en el alteado del muro perimetral con el agregado de concertina de seguridad. Además se ejecutará a nuevo un baño y se refuncionalizará un sector de galería para acondicionar un deposito. Se reconstruirán pisos levantados en algunos sectores y se recuperararan cubiertas de chapa y canaletas. Se realizará un repaso de la instalación eléctrica proveyendo nuevos tableros para zona de baños y perimetro de iluminacion exterior. Se proveerán carpinterías nuevas en sectro baños y depósito se colocará una divisoria  con alambrado y cerco olímpicos y un portón de dos hojas.', '13 00 01 52', 1, 0, 0, NULL, 0, 0, NULL, 0, NULL, 28, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 1077719.83, 2235878.05, 0, NULL, NULL, NULL, 0, 2022, NULL, 0, 'Ene-23', 0, 10, 1524, 17227153.04, 0, '2023-03-23 00:00:00', 'DEyP', '2023-03-02 00:00:00', '2023-02-13 00:00:00', 'Disp. N° 264/23', 'Disp. Nº87/24', '2023-10-01 00:00:00', '2024-04-08 00:00:00', 0, 0, NULL, 0, NULL);
