INSERT INTO `obras` VALUES (1246, 'Club Deportivo Rivadavia - Restauracion Tejido Perimetral e Iluminacio', 'Disp. N° 52/23', 37468404.03, 49, 1, 3, 2, 300, 3, 4, 12, '2023-06-05 00:00:00', '2023-06-20 00:00:00', '2024-04-15 00:00:00', 'Restauración del tejido perimetral del campo de juego en los siguientes clubes: LIPTON FUUTBALL CLUB: cambio del 60% del vallado, reposición del 40 % de postes olímpicos, reposición de alambres de puas sobre tejido perimetral - Reposición de portones, pintura del vallado - CLUB SPORTIVO CORRIENTES: recambio del 60% de la malla, retiro y reposición de 12 postes olímpicos, retiro y reposición de alambre de púas sobre malla, reparación de portones, pintura general del vallado- CLUB ATLECTICO LIBERTAD: retiro de sectores de malla  y postes olímpicos en mal estado, reposición de los mismos, reposición de alambre de púa sobre malla, reparación de portones, reparación de tribuna, pintura general del vallado. - CLUB SPORTIVO FERROVIARIO: retiro y reparación del 60 % del tejido perimetral, retiro y reposición de alambre de púa sobre tejido, reparación de portones, refacción de revoques del murete de mampostería base del tejido, pintura general del vallado - CLUB DEPORTIVO RIVADAVIA: retiro de postes metálicos y tejido existente, construcción a nuevo de todo el tejido perimetral del campo de juego, con postes olímpicos y malla metálica, provisión y colocación de portones, pintura general del vallado.', '13 00 01 94', 1, 0, 60, '2024-07-27 00:00:00', 0, 0, NULL, 0, NULL, 58, 'Resol N°671/24', NULL, NULL, NULL, NULL, NULL, 0, NULL, 7571421.38, 10845484, 5534679.41, NULL, NULL, NULL, 0, 2022, NULL, 0, 'Feb-23', 0, 10, 1516, 38058307.8, 1, '2023-04-25 00:00:00', 'DC', '2023-03-29 00:00:00', '2023-03-06 00:00:00', NULL, NULL, NULL, NULL, 0, 0, NULL, 0, NULL);
