INSERT INTO `obras` VALUES (1261, 'Museo Casa Antigua - Restauracion 2da etapa', NULL, 58209374.17, 132, 24, 3, 3, 180, 1, 30, 3, NULL, NULL, NULL, 'Construccion de cubierta de tejas francesas, restauracion exterior e interior del local original, Construccion de nuevos locales, restauracion de galerias, construccion de veredas, instalacion electrica, iluminacion ornamental y trabajos complementarios.', NULL, 20, 0, 0, NULL, 0, 0, NULL, 0, NULL, 6, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 0, 0, 0, NULL, NULL, NULL, 0, 2022, NULL, 0, 'May-23', 0, 13, 1410, 58209374.17, 0, NULL, 'DIR', NULL, '2023-07-03 00:00:00', NULL, NULL, NULL, NULL, 0, 0, NULL, 0, NULL);
INSERT INTO `obras` VALUES (1262, 'Club "Juventud Unida" - 2da Etapa', 'n', 153074482.14, 132, 24, 3, 11, 360, 2, 32, 12, NULL, '2024-01-01 00:00:00', '2024-01-01 00:00:00', 'En esta etapa se considera intervenir las instalaciones existentes en el club ;\r\nSe realizaran la losa de entrepiso y la planta alta,la cubierta de chapa ondulada con aislacion termica sobre correas de chapa,estructura reticulada que soporta dicha cubierta.,se colocaran pisos de mosaicos graniticos 30x30 cm.con zocalos del mismo material .cielorrasos de listones de PVC. Sobre estructura de aluminio independiente en los locales: SUM.,VESTUARIOS,BAÑO DE ARBITROS,BAÑO DISCAPACITADOS y de placas de yeso en los locales de ADMINISTRACION en planta baja y planta alta,ESCALERA y DEPOSITO.\r\nTodas las mamposterias se completaran con revoques grueso y fino y se aplicara pintura al latex como terminacion.\r\nSe dotara a las instalaciones de vestuarios y baños de provision de agua fria y caliente,esta ultima producida por termotanques que aprovisionaran a la cocina, las duchas de vestuarios y de baños.\r\nTambien se construira en forma completa la red de desagues primarios y secundarios para conducir todas las aguas servidas a la red cloacal.\r\nSe proveera e instalara dentro el predio una torre tanque con tanques tricapa de polietileto de reserva (dos tanques de 3000lts.) y de bombeo uno, de 1500lts.de capacidad,alimentados desde la red de distribucion de agua potable y elevados mediante bombas de impulsion elect ricas.\r\nSe proveera a las instalaciones de energia electrica a traves de un cable subterraneo.\r\nEn planta  baja,desde alli se distribuye por diferentes circuitos a los artefactos de iluminacion ,apliques y tomacorrientes ubicados en los diferentes locales.\r\nTambien se alimentan los tableros seccionales (dos) uno para planta alta y otro para  las bombas de impulsion de la torre tanque de agua.\r\nSe completan las instalaciones con un cercado  en el frente, lateral lindero y fondo, con cerco olímpico y tejido romboidal. \r\nEn los locales cocina, escalera, administración y bombas de impulsion estaran ubicados los matafuegos de 5 kg. De carga previstos para casos de incendios que se complementan con las salidas de emergencias señalizadas con cartelesfotoluminicosy los detectores de humo.\r\nSup.total : 22..500 m2,   Sup. Intervenida: 320 m2,   Sup cubierta :233 m2', '13 00 00 00', 16, 0, 0, NULL, 0, 0, NULL, 0, NULL, 58, 'Nota N° 153/23', NULL, NULL, NULL, NULL, '29/2/24- Enviado a Archivo por orden de la superioridad', 0, NULL, 0, 0, 0, NULL, NULL, NULL, 1, 2024, '000-000153/23', 0, 'Ago-23', 0, 13, 1386, 153074482.14, 0, NULL, 'DC', NULL, '2023-09-26 00:00:00', NULL, NULL, NULL, NULL, 0, 0, NULL, 0, NULL);
