INSERT INTO `obras` VALUES (1284, 'Teatro Oficial "Juan de Vera" - Foyer, Pasillos, Fachada y Sala - Pues', 'Resol. N° 132/24', 400628260.26, 114, 35, 3, 2, 300, 2, 4, 3, '2024-05-20 00:00:00', '2024-06-03 00:00:00', '2025-03-30 00:00:00', 'Los trabajos a ejecutar en el Teatro Oficial Juan de Vera, comprenden cuatro zonas, Fachada principal, Foyer y dependencias aledañas, Pasillos laterales de la herradura de la sala, y la Sala propiamente dicha.\r\n\r\nEn FACHADA, la intervención consistirá en su puesta en valor, se repararán los elementos dañados y limpieza general del paramento. Se realizarán tareas de pintura y reparación de fisuras, refuerzo de balaustrada y pasamanos en balcones, hidrolavado de mármoles, reemplazo de piezas rotas en escalinatas. Se realizará el cambio de artefactos eléctricos por sistema LED tipo bañador y proyectores, y el reemplazo de cableado por cables nuevos con retiro de cables sin uso y cables colgantes. A nivel estético se realizará un trabajo artesanal de Dorado a la hoja sobre las Cariátides del coronamiento y ornamentos del mismo sector.\r\n\r\nEn FOYER, se realizará la limpieza de luminarias, arañas, colgantes y apliques, con cambio de luminarias. Se realizarán trabajos de pintura en cielorraso y paredes, limpieza de barandas y herrería, y ejecución de tableros secundarios nuevos bajo norma IRAM y AEA, en la zona de boletería y Bar, con cambios de llaves, puesta a tierra y otros. \r\n\r\nEn PASILLOS laterales de la herradura en planta baja, planta piso 1, piso 2 (Cazuela) y piso 3 (Paraíso), se realizarán trabajos de rasqueteo, impermeabilización, reconstrucción de revoques, pintura de paredes y cielorrasos. En cuanto a la instalación eléctrica, se ejecutará el retiro de cableado deteriorado, y su reemplazo por recableado nuevo.\r\n\r\nEn SALA se realizarán trabajos de pintura, con sus trabajos anexos de rasqueteos y preparación de superficies de paredes y cielorrasos de palcos, tertulias, cazuela y columnas del paraíso. También se realizará la limpieza de butacas y panas de sala. A nivel de la instalación eléctrica, se reemplazarán las luminarias de sala (solo focos), por LEDs tipo vintage dimerizables. \r\n\r\nSe restaurarán las carpinterías que necesitan intervención.', '13 00 01 60', 1, 0, 0, NULL, 0, 0, NULL, 0, NULL, 28, NULL, NULL, NULL, NULL, NULL, 'El Basico del Contrato es a Feb-24', 0, NULL, 92111828.68, 38548895.59, 25095344.6, NULL, NULL, NULL, 0, 2022, NULL, 0, 'Dic-23', 0, 10, 93, 298976308.66, 1, '2024-03-21 00:00:00', 'DEyP', '2024-02-09 00:00:00', '2024-01-25 00:00:00', NULL, NULL, NULL, NULL, 0, 0, NULL, 0, NULL);
INSERT INTO `obras` VALUES (1285, 'Teatro Oficial "Juan de Vera" - Caja Escenotecnica y Acceso de Servici', 'Resol. N° 1467/24', 973789148.3, 114, 35, 3, 2, 300, 2, 4, 3, '2024-10-01 00:00:00', '2024-10-08 00:00:00', '2025-08-04 00:00:00', 'En esta etapa de trabajos en el Teatro Oficial Juan de Vera, se intervendrá en diversas áreas:\r\nSubsuelo del escenario: Se demolerán y retirarán estructuras de madera existentes, reemplazándolas por una nueva estructura metálica modular que soportará bastidores de madera y fenólico.\r\nEscenario: Se demolerá y reemplazará su estructura, reubicando contrapesos y mecanismos de elevación para mejorar la circulación.\r\nFoso de orquesta: Se pintarán paredes y se reconstruirá el piso de parquet.\r\nPuentes técnicos 1 y 2: Se reemplazarán escaleras por metálicas y se revisarán carpinterías, asegurando funcionalidad y estanqueidad.\r\nAcceso de servicio: Se pintará completamente, incluyendo la escalera metálica de incendios, y se construirá un techo marquesina.\r\nBoletería: Se demolerán paredes y se realizará un pasillo para independizar el sector de servicios, además de pintar y acondicionar el área.\r\nSala: Se mejorará el piso de parquet y se reemplazarán alfombras y luces de emergencia.\r\nBalcones de fachada: Se impermeabilizarán y restaurarán mármoles y balaustradas.\r\nEstos trabajos buscan mejorar la funcionalidad, seguridad y estética del teatro.', '13 00 01 60', 1, 0, 0, NULL, 0, 0, NULL, 0, NULL, 28, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 121473136.27, 0, 0, NULL, NULL, NULL, 0, 2022, NULL, 0, 'May-24', 0, 10, 93, 973894405.8, 1, '2024-08-29 00:00:00', 'DEyP', '2024-08-05 00:00:00', '2024-07-15 00:00:00', NULL, NULL, NULL, NULL, 0, 0, NULL, 0, NULL);
